insert into Product(id , product_Name, product_Quantity, product_Category, product_Price, product_Description, product_Image_Url)
values
    (1, 'Nylabone Puppy Chew Dog Bone - Chicken Flavor - 4.5" Regular Size', 45, 'toy', 3, 'Nylabone Puppybone is specifically designed for teething puppies to encourage non-destructive chewing. Helps clean teeth. Helps control plaque and tartar. Not recommended for dogs with any adult teeth.', 'https://www.petproducts.com/static/upload/products/assorted/nylabone--puppy-chew-dog-bone-chicken-flavor/o6eoveo.jpg'),
    (2, 'Nylabone Puppy Starter Kit, 3 ct', 23, 'toy', 9, 'Veterinarian approved Puppy Starter Kit from Nylabone is made for your puppy''s chewing needs. Includes the following: Puppybone: For puppies over 2 months of age. Flexible Puppybone is recommended for young puppies. This chew is more pliable and is specifically designed to assist in the growth and development of teeth and jaw. Healthy Edibles - Bacon Flavored: Is an edible dog treat recommended for puppies 3 months and older.', 'https://www.petproducts.com/static/upload/products/assorted/nylabone--puppy-starter-kit-3-ct/7ux3vvm.jpg'),
    (3, 'Nylabone Dura Chew Wishbone - Original Flavor - Regular - For Dogs up to 50 lbs', 50, 'toy', 5, 'Bristles raised during chewing help clean teeth and control plaque & tartar build-up.', 'https://www.petproducts.com/static/upload/products/assorted/nylabone--dura-chew-wishbone-original-flavor-regular-for-dogs-up-to-50-lbs/e7jxm6v.jpg'),
    (4, 'Nylabone Puppy Chew Teething Keys Chew Toy - Small', 32, 'toy', 10, 'One of the best chew toys for teething puppies, Nylabone is perfect for teething dogs of all sizes and types. They will love this teething toy. Puppy Teething Keys are designed for young puppies to aid in the growth and development of their teeth and jaws, and to encourage safe and non-destructive chewing. Great Bacon Flavor! Not recommended for dogs and puppies with any adult teeth. This will also reduce bad breath as your dog will keep his teeth clean by chewing on Nylabone''s safe and colorful toys to encourage safe chewing behavior.', 'https://www.petproducts.com/static/upload/products/assorted/nylabone--puppy-chew-teething-keys-chew-toy-small/qqjtl4o.jpg'),
    (5, 'Nylabone Puppy Chew Teething Keys Chew Toy -Small (For Dogs up to 25 lbs)', 12, 'toy', 9, 'Puppy Teething Keys are designed for young puppies to aid in the growth and development of their teeth and jaws, and to encourage safe and non-destructive chewing. Great Bacon Flavor! Not recommended for dogs and puppies with any adult teeth.', 'https://www.petproducts.com/static/upload/products/assorted/nylabone--puppy-chew-teething-keys-chew-toy--small-for-dogs-up-to-25-lbs/o8lphjo.jpg'),
    (6, 'Nylabone Puppy Chew Teething Pacifier - X-Small', 35, 'toy', 9, 'Made from soft, flexible material, the Puppy Pacifier from Nylabone Products is specially designed for teething puppies who have not formed their adult teeth. This non-edible, flexible product comes in dynamic, colorful shapes that are easy for young dogs to pick up, chew and enjoy their flavorful taste - helping to clean teeth, and control tartar and plaque build-up. It also encourages puppies to develop non-destructive chewing habits that will last a lifetime.', 'https://www.petproducts.com/static/upload/products/assorted/nylabone--puppy-chew-teething-pacifier-x-small/t2ur99f.jpg'),
    (7, 'Nylabone Puppy Chew Textured Ring & Bone - Chicken Flavor - Petite (1 Pack)', 48, 'toy', 3, 'The Puppy Ring Bone is specifically designed for teething puppies to encourage the development of non-destructive chewing habits. Not recommended for dogs with any adult teeth.', 'https://www.petproducts.com/static/upload/products/assorted/nylabone--puppy-chew-textured-ring+bone-chicken-flavor-petite-1-pack/b4wv8g7.jpg'),
    (8, 'Nylabone Dura Chew Durable Dog Bone - Bacon Flavor - Petite - Dogs 1-15 lbs', 32, 'toy', 2, 'Designed for powerful chewers. Bristles raised during chewing help clean teeth and control plaque & tartar build-up.', 'https://www.petproducts.com/static/upload/products/assorted/nylabone--dura-chew-durable-dog-bone-bacon-flavor-petite-dogs-1-15-lbs/bsj3dm3.jpg'),
    (9, 'Nylabone Dura Chew Double Bone - Bacon Flavor - Petite - Dogs up to 15 lbs', 28, 'toy', 7, 'Veterinarian recommended, Nylabone DuraChews are a long lasting chew designed for powerful chewers. Tiny bristles raised during chewing help clean teeth while controlling the build up of plaque and tartar.', 'https://www.petproducts.com/static/upload/products/assorted/nylabone--dura-chew-double-bone-bacon-flavor-petite-dogs-up-to-15-lbs-/c3auwzh.jpg'),
    (10, 'Nylabone Dura Chew Barbell Dog Chew Toy - Peanut Butter Flavor - Medium/Large', 40, 'toy', 8, 'Especially important for powerful chewers, the appropriate chew toys can help keep dogs busy, prevent boredom, help with separation anxiety and help prevent destructive chewing. New - Peanut Butter Flavor!', 'https://www.petproducts.com/static/upload/products/assorted/nylabone---dura-chew-barbell-dog-chew-toy-peanut-butter-flavor-medium-large/9wqnckk.jpg'),
    (11, 'Nylabone Dura Chew Smooth White Dog Bone - Chicken Flavor - Petite (1 Pack)', 19, 'toy', 3, 'Nylabone Chews are a long-time favorite of both Pets and their Parents. Designed to let dogs indulge their natural urge to chew in a safe, healthy and tasty way. Available in a tasty chocolate flavor.', 'https://www.petproducts.com/static/upload/products/assorted/nylabone--dura-chew-smooth-white-dog-bone-chicken-flavor-petite-1-pack/9f5f0sb.jpg'),
    (12, 'Nylabone Flexi Chew Dog Bone, Chicken Flavor - Petite', 39, 'toy', 4, 'Chicken flavored Nylabone Flexible bone with baked-in flavor particles. These unique therapeutic toys are designed to satisfy the chewing instinct of average chewers. Use Nylabone Durable Bones for aggressive chewers.', 'https://www.petproducts.com/static/upload/products/assorted/nylabone--flexi-chew-dog-bone-chicken-flavor-petite-/qcnp4h0.jpg'),
    (13, 'Nylabone Dura Chew Power Chew Flavor Medley Bone - Small', 48, 'toy', 4, 'Made from tough durable nylon for Powerful Chewers', 'https://www.petproducts.com/static/upload/products/assorted/nylabone--dura-chew-power-chew-flavor-medley-bone-small/l1f80jj.jpg'),
    (14, 'Nylabone Dura Chew White Textured Dog Bone - Chicken Flavor - Souper - 8.5" Long', 23, 'toy', 14, 'Nylabone DuraChew Super Chew Textured Bones are made of tough, durable nylon and are specially designed for powerful chewers. Each bone features varied textures, including bumps and ridges, to help clean teeth and promote healthy gums. A medley of delicious flavors insures that your powerful chewer will keep coming back for more.', 'https://www.petproducts.com/static/upload/products/assorted/nylabone--dura-chew-white-textured-dog-bone-chicken-flavor-souper-85-long/0w7mihy.jpg'),
    (15, 'Nylabone Dura Chew Textured Ring - Chicken Flavor - Souper - Dogs over 50 lbs', 24, 'toy', 14, 'This veterinarian recommended Nylabone Durable is a long lasting chew designed for powerful chewers. Multiple textures offer increased tactile and chewing appeal. New Flavor Medley brings more tasty flavor for your large dog to enjoy. Made for dogs 50+ lbs who are extreme chewers. Bristles raised during chewing help clean teeth and the cleaning action helps control plaque and tartar build-up.', 'https://www.petproducts.com/static/upload/products/assorted/nylabone--dura-chew-textured-ring-chicken-flavor-souper-dogs-over-50-lbs/tfxjb5m.jpg'),
    (16, 'Nylabone Dura Chew Textured Ring & Bone - Petite - 4" Long', 15, 'toy', 2, 'Veterinarian recommended Nylabone DuraChews are a long lasting chew designed for powerful chewers. Tiny bristles raised during chewing help clean teeth while controlling the build-up of plaque and tartar. These unique ring bones feature a tasty Flavor Medley throughout that encourages active chewing. Made in the USA.', 'https://www.petproducts.com/static/upload/products/assorted/nylabone--dura-chew-textured-ring+bone--petite-4-long-/3ntlxo3.jpg'),
    (17, 'Nylabone Dura Chew Dog Bone - Original Flavor - Giant (1 Pack)', 25, 'toy', 8, 'Veterinarian approved Nylabone Durables are long lasting and specifically designed for strong chewers. Wears down slowly and will not splinter or break. Impregnated with a mild flavoring to catch hold your dog''s interest.', 'https://www.petproducts.com/static/upload/products/assorted/nylabone--dura-chew-dog-bone-original-flavor-giant-1-pack-/ddx9b2x.jpg'),
    (18, 'Spot Dura-Fused Leather Squirrel Dog Toy', 38, 'toy', 6, 'It''s time to give your dog''s jaws a real challenge! Spot''s Dura-Fused Leather Squirrel Toy is built tough, made with real leather and super strong jute fabric and held together with double-stitched seams for ultimate durability.', 'https://www.petproducts.com/static/upload/products/assorted/spot--dura-fused-leather-squirrel-dog-toy/63w0i7c.jpg'),
    (19, 'Spot Skinneeez Plush Raccoon Dog Toy - Mini', 30, 'toy', 8, 'Bring out your dogs natural hunting instinct. Dogs will enjoy hours of entertainment flip flopping our stuffing free skinneez toys. All Skinneez toys have 2 squeakers. 1 in the head and 1 in the tail for double the fun.', 'https://www.petproducts.com/static/upload/products/assorted/spot--skinneeez-plush-raccoon-dog-toy-20-long-/nhtmz52.jpg'),
    (20, 'Flossy Chews Colored Rope Bone - Medium (12" Long)', 30, 'toy', 2, 'Mammoth Flossy Chews Color Rope Bones are made of natural select 100% cotton. Color Flossy Rope Bones clean your dog''s teeth and gums, whisking away plaque and tartar as he chews. These premium quality rope bones are tightly woven for long-lasting performance.', 'https://www.petproducts.com/static/upload/products/assorted/mammoth-flossy-chews-colored-rope-bone-medium-6-long-/gj6hwzc.jpg'),
    (21, 'Flossy Chews Colored 3 Knot Tug Rope - Medium - 20" Long', 28, 'toy', 4, 'Mammoth Flossy Chews'' Color 3 Knot Tug is natural select 100% cotton. This premium quality knot tug is tightly woven for long-lasting performance and helps remove plaque and tarter buildup from your pets teeth.', 'https://www.petproducts.com/static/upload/products/assorted/mammoth-flossy-chews-colored-3-knot-tug-rope-medium-20-long-/nhmo174.jpg'),
    (22, 'Mammoth Flossy Chews Colored 4 Knot Tug Rope - Large (22" Long)', 44, 'toy', 12, 'Toss - Tug - Floss', 'https://www.petproducts.com/static/upload/products/assorted/mammoth--flossy-chews-colored-4-knot-tug-rope-large-22-long-/101dsm9.jpg'),
    (23, 'Booda Soft Bite Hedgehog Dog Toy, Medium - 4.75" Long', 28, 'toy', 3, 'The grunting Hedgehog it a favorite among dogs in the know. He is cute, playful and makes the best sound!', 'https://www.petproducts.com/static/upload/products/assorted/booda--soft-bite-hedgehog-dog-toy-medium-475-long-/ghvkfmx.jpg'),
    (24, 'Chuckit! Classic Ball Launcher - 26 in', 22, 'toy', 21, 'The Chuckit, designed for hands-free pickup without bending over, is made to exercise your dog and not wear out your arm.', 'https://www.petproducts.com/static/upload/products/assorted/chuckit--classic-ball-launcher-26-in/clo38vu.jpg'),
    (25, 'Chuckit! Indoor Ball, 5.75"', 15, 'toy', 12, 'The Chuckit!® Indoor Ball is the perfect complement to wet or cold days, hardwood floors or late-night games of fetch inside. Made from textured chenille fabric that is ideal for small dogs and puppies. The soft construction is safe for indoor use and Features Bounceflex Core technology for a lightweight design which makes it soft enough when meeting a wall or furniture while still giving it just the right amount of bounce for indoor playtime. The multilayer construction provides added durability for long-lasting use. Use with the Chuckit! Indoor Launcher (not included) for no-slobber, hands-free pickup.', 'https://www.petproducts.com/static/upload/products/assorted/chuckit--indoor-ball-575/nsctz6p.jpg'),
    (26, 'Chuckit! Max Glow Ball, X-Large - 3.5"', 24, 'toy', 11, 'Now the fetch games don''t have to stop when the sun goes down! Introducing the new Glow Ball, for night-time play. Simply charge the Glow Ball by holding it up to a light source, resulting in a brilliant green glow. Compatible with Chuckit Ball Launcher.', 'https://www.petproducts.com/static/upload/products/assorted/chuckit--max-glow-ball-x-large-35/3foilvh.jpg'),
    (27, 'Chuckit Paraflight - Large - 9.5" Diameter (1 Pack)', 34, 'toy', 16, 'ChuckIt Paraflight Dog Toy is perfect for games of fetch, whether you''re out in the yard or in water! The paraflight features a soft rubber edge thats gentle on your dogs gums and teeth, but a strong nylon interior that makes it plenty durable for playtime.', 'https://www.petproducts.com/static/upload/products/assorted/chuckit-chuckit-paraflight-large-95-diameter-1-pack-/5nhy1od.jpg'),
    (28, 'Chuckit! Pocket Ball Launcher', 37, 'toy', 9, 'The Chuckit Pocket is compact, portable, designed for hands-free pick up, and its size enables you to take fetch games anywhere. Use with Chuckit compatible balls or standard size tennis balls.', 'https://www.petproducts.com/static/upload/products/assorted/chuckit--pocket-ball-launcher/9lsv851.jpg'),
    (29, 'Chuckit! The Whistler Chuck-It Ball, Medium, 2.5" Diameter - 2 pk', 36, 'toy', 9, 'Ready, set, fetch! The Chuckit!® Whistler® keeps the game of fetch interesting and challenging for your dog. Four holes in this high-bouncing rubber ball produce a whistle as it soars through the air to keep your dog interested and focused. Gripable rubber ball is made just the right size to use with your Chuckit! Launcher.', 'https://www.petproducts.com/static/upload/products/assorted/chuckit--the-whistler-chuck-it-ball-medium-25-diameter-2-pk/c1fkdwb.jpg'),
    (30, 'Chuckit! Ultra Ball, X-Large, 3.5"', 14, 'toy', 12, 'Designed for the most demanding use, this is no ordinary ball. Simply put, this is the best ball for the game of fetch. Has a high bounce, floats, very visible and durable, this ball is also compatible with the Chuckit Ball Launchers.', 'https://www.petproducts.com/static/upload/products/assorted/chuckit--ultra-ball--x-large-35/n4xpifk.jpg'),
    (31, 'Fat Cat Suspicious Chicken Flobbability Barnyard Bullies - (14" Long x 5.5" Wide)', 18, 'toy', 8, 'Maximum Floppability gives every dog somethin to cluck about! Barnyard Bullies Suspicious Chicken is for your dog! It has great floppy parts that whack your dog''s head when shaken about. Made of heavy-duty canvas, and contains a squeaker for more added fun!', 'https://www.petproducts.com/static/upload/products/assorted/fat-cat--suspicious-chicken-flobbability-barnyard-bullies-14-long-x-55-wide-/psv5cwq.jpg'),
    (32, 'KONG Squeakers Tennis Ball with Rope-2.5" diameter tennis ball; 15" long rope', 49, 'toy', 4, 'How do you make an Air KONG squeaker ball even better? Add a strong nylon throw rope so you can really get it going! These are real tennis ball toys, in an ultra-fetchable shape that''s great for play on land or in the water. Heavy duty toys will stand up to plenty of vigorous, supervised play.', 'https://www.petproducts.com/static/upload/products/assorted/kong--squeakers-tennis-ball-with-rope-25-diameter-tennis-ball-15-long-rope-/pwnfzau.jpg'),
    (33, 'Spot Vinyl Hamburger & Fries Dog Toy', 49, 'toy', 11, 'The Spot Burger and Fries Vinyl Dog Toy gives your dog all the fun of fast food with none of the calories! These super chewable toys are tons of fun for your pooch to chase around the yard or hide away in that special place where he hides things.', 'https://www.petproducts.com/static/upload/products/assorted/spot--vinyl-hamburger+fries-dog-toy/na0h005.jpg'),
    (34, 'Spot Skinneeez Plush Flying Squirrel Dog Toy - 23" Long', 19, 'toy', 7, 'Our Extremely Popular Line Of Skineeez Is Back In Full Force - Bigger And Better Than Ever! Bring Out A Dogs Natural Hunting Instinct With These Realistic Animals.', 'https://www.petproducts.com/static/upload/products/assorted/spot--skinneeez-plush-flying-squirrel-dog-toy-23-long-/zqi6uwf.jpg'),
    (35, 'Spot Spotbites Plush Bone Dog Toy with Embroidered Face - 8.5" Long', 44, 'toy', 4, 'Spot Plush Embroidered Face Bones will provide fun and entertainment for your dog. He''ll love the giant bone shape and built-in squeaker, and the soft plush makes it safe for tons of fetching and tossing fun!', 'https://www.petproducts.com/static/upload/products/assorted/spot--bites-plush-bone-dog-toy-with-embroidered-face-85-long-/qrra7rs.jpg'),
    (36, 'Spot Mop Pets Dog Toys - Monkey', 33, 'toy', 12, 'Moppets Plush & Rope Monkey', 'https://www.petproducts.com/static/upload/products/assorted/spot--mop-pets-dog-toys-monkey/11ialws.jpg'),
    (37, 'JW Pet Crackle Heads Ball Dog Chew Toy - Assorted', 14, 'toy', 5, 'A twist on the classic rubber ball. Durable rubber with a ball inside made of water bottle material.', 'https://www.petproducts.com/static/upload/products/assorted/jw-pet--crackle-heads-ball-dog-chew-toy-assorted/y8uomf4.jpg'),
    (38, 'JW Pet Hol-ee Football Rubber Dog Toy - Mini (3.75" Long)', 38, 'toy', 3, 'Could we invent something as great as football for a dog? The Hol-ee Football does the trick as a super-durable, super-stretchy multipurpose dog toy. Its a fantastic treat ball, wonderful training aid, great for fetch, toss and tug, chewing and teething.', 'https://www.petproducts.com/static/upload/products/assorted/jw-pet--hol-ee-football-rubber-dog-toy-mini-375-long-/ouao882.jpg'),
    (39, 'JW Pet iSqueak Ball - Rubber Dog Toy - Small - 2" Diameter', 23, 'toy', 4, 'Long-lasting toy is fashioned of thick walled heavy duty rubber and finished with a long-winded squeaker. Great toy for the dog who chews and rips apart other toys.', 'https://www.petproducts.com/static/upload/products/assorted/jw-pet--isqueak-ball-rubber-dog-toy-small-2-diameter-/q5swz70.jpg'),
    (40, 'JW Pet iSqueak Bouncing Baseball Rubber Dog Toy - Small, 2"', 34, 'toy', 2, 'The new iSqueak iSqueak Bouncin'' Baseball is a squeaky sporty durable rubber ball. These toys are meant to be tossed, passed, carried, and chewed! Available in fun bright colors for canine athletes of all sizes.', 'https://www.petproducts.com/static/upload/products/assorted/jw-pet--isqueak-bouncing-baseball-rubber-dog-toy-small-2/9oncmq1.jpg'),
    (41, 'JW Pet iSqueak Funble Football Rubber Dog Toy, Large', 31, 'toy', 12, 'The new iSqueak Funble Football is a squeaky sporty durable rubber balls. This toy is meant to be tossed, passed, carried, and chewed! Available in fun bright colors for canine athletes of all sizes.', 'https://www.petproducts.com/static/upload/products/assorted/jw-pet--isqueak-funble-football-rubber-dog-toy-large/ebm9zdr.jpg'),
    (42, 'JW Pet Megalast Rubber Dog Toy - Ball - Medium, 3" Diameter', 45, 'toy', 4, 'The MegaLast Balls are tough toys from JW Pet made of our durable Megalastomer. Infused with vanilla. These buoyant, floating toys are mega strong, mega bouncy, and mega fun! The MegaLast toys are Made in the USA in an eco-friendly facility that utilizes solar power. All MegaLast toys are 100% recyclable. Color may vary.', 'https://www.petproducts.com/static/upload/products/assorted/jw-pet--megalast-rubber-dog-toy-ball-medium-3-diameter/834rpp6.jpg'),
    (43, 'JW Pet Megalast Rubber Dog Toy - Long Dog - Medium - 6.5" Long', 32, 'toy', 4, 'Its a hilarious idea to use both a long-dog-shape built around a squeaker. In fact the Megalast Long Dog is the first Megalast toy with a squeaker. This durable, floatable, rubber-like chew toy is mega-strong, mega-bouncy and mega-fun. Measures 6.5" Long', 'https://www.petproducts.com/static/upload/products/assorted/jw-pet--megalast-rubber-dog-toy-long-dog-medium-65-long-/pdjjip8.jpg'),
    (44, 'JW Pet Ruffians Rubber Dog Toy - Chicken', 45, 'toy', 6, 'Squeaking Rubber Dog Toy', 'https://www.petproducts.com/static/upload/products/assorted/jw-pet--ruffians-rubber-dog-toy-chicken/exmf72q.jpg'),
    (45, 'JW Pet Hol-ee Mol-ee Extreme Rubber Chew Toy - 5" Diameter', 38, 'toy', 9, 'Available in black and purple', 'https://www.petproducts.com/static/upload/products/assorted/jw-pet--hol-ee-mol-ee-extreme-rubber-chew-toy-5-diameter-/y4ue44g.jpg'),
    (46, 'Li''l Pals Crinkle Elephant Dog Toy - Pink Elephant 8" Long', 44, 'toy', 8, 'Li''l Pals offers a complete range of quality products for tiny pups. Perfectly proportioned to meet the needs of petite pets. This Lil Pals Crinkle Elephant Dog Toy features a stuffing-free body filled with crinkle paper for added crackling fun noise while your puppy plays.', 'https://www.petproducts.com/static/upload/products/assorted/lil-pals--crinkle-elephant-dog-toy-pink-elephant-8-long-/j50p441.jpg'),
    (47, 'Li''l Pals Fleece Bone Toy for Dogs & Puppies', 13, 'toy', 3, 'The Li''l Pals Fleecy Plush Dog Bone is the perfect soft, chewable, squeaky toy for your little pal! Made of soft, fleecy plush, this little bone is almost as cute as your fur baby! Soft plush squeaky bone Great for games of indoor fetch Perfect for puppies and toy breeds Fleece is gentle on teeth and gums. 4.5" Long', 'https://www.petproducts.com/static/upload/products/assorted/lil-pals--fleece-bone-toy-for-dogs+puppies/wrsx8ea.jpg'),
    (48, 'Li''l Pals Plush Basketball Plush Tug Dog Toy - Brown', 18, 'toy', 4, 'Li''l Pals offers a complete range of quality products for tiny pups. Small-scale collars, toys, grooming tools, identification tags and bandannas are perfectly proportioned to meet the needs of petite pets.', 'https://www.petproducts.com/static/upload/products/assorted/lil-pals--plush-basketball-plush-tug-dog-toy-brown/eersvfs.jpg'),
    (49, 'Li''l Pals Plush Hamburger Dog Toy', 15, 'toy', 3, 'Coastal''s Li''l Pals Plush and Vinyl Dog Toys are pint-sized to fit perfectly in your petite dog or puppy''s mouth. The texture variety and enticing shape will provide hours of fun and exercise.', 'https://www.petproducts.com/static/upload/products/assorted/lil-pals--plush-hamburger-dog-toy/4frv4t3.jpg'),
    (50, 'Li''l Pals Plush Man Dog Toy', 21, 'toy', 3, 'Lil Pals'' Fleece Wooly Man Toy is designed with the size-challenged dog in mind! The Wooly Man is easy on teeth and gums, and just the right size for chewing, indoor fetch or just for your little fella to cuddle.', 'https://www.petproducts.com/static/upload/products/assorted/lil-pals--plush-man-dog-toy/gsb1zbu.jpg'),
    (51, 'Nylabone Dura Chew Smooth White Dog Bone - Chicken Flavor - Large', 17, 'toy', 10, 'Nylabone DuraChew Chicken Flavor Giant Chew Bones are long lasting, flavor enhanced bones that dogs can''t resist. Made of tough nylon in a shape dogs can grip easily, DuraChew chew toys are perfect for relieving the natural chewing instincts of powerfu chewers.', 'https://www.petproducts.com/static/upload/products/assorted/nylabone--dura-chew-smooth-white-dog-bone-chicken-flavor-large/q5w02bb.jpg'),
    (52, 'Plush Puppies Plush Hide-A-Squirrel Dog Toy - Junior - 4.5" Diameter', 38, 'toy', 10, 'The ideal toy to challenge and entertain your dog while helping improve his intelligence. Just insert the toys into the toy and watch your dog remove them, one by one!', 'https://www.petproducts.com/static/upload/products/assorted/plush-puppies--plush-hide-a-squirrel-dog-toy-junior-45-diameter/7h1stiu.jpg'),
    (53, 'Chuckit! Amphibious Bumper Toy - Large', 37, 'toy', 12, 'On land and in the water Chuckit! Amphibious toys are designed for exceptional visibility and performance.', 'https://www.petproducts.com/static/upload/products/assorted/chuckit--amphibious-bumper-toy-large/jv2tcjh.jpg'),
    (54, 'Chuckit! Fetch Ball, Large - 3"', 22, 'toy', 6, 'Chuckit Fetch Balls are made to deliver the highest bounce possible to keep your pet having fun! These balls come in bright colors and are made with natural rubber. They''re super easy to clean, so take ''em anywhere!', 'https://www.petproducts.com/static/upload/products/assorted/chuckit--fetch-ball-large-3/7nh39nj.jpg'),
    (55, 'Chuckit! Tennis Balls, 2.25" Diameter, 2 ct', 16, 'toy', 4, 'Chuckit!® Tennis Balls are made of high-quality materials and specifically designed for the game of fetch. Constructed of a natural rubber it features an extra-thick rubber core and durable material that floats in water. The bright colors provide improved visibility when playing with your dog and help to prevent the ball from being lost. Use alone, or with your Chuckit! Launcher (sold separately).', 'https://www.petproducts.com/static/upload/products/assorted/chuckit--tennis-balls--225-diameter--2-ct/cqce3jc.jpg'),
    (56, 'JW Pet Bad Cuz Rubber Squeaker Dog Toy - Medium - 4" Tall', 18, 'toy', 5, 'Find a toy to fit the personality of the dog', 'https://www.petproducts.com/static/upload/products/assorted/jw-pet--bad-cuz-rubber-squeaker-dog-toy-medium-4-tall-/lujqpfv.jpg'),
    (57, 'JW Pet Good Cuz Rubber Squeaker Dog Toy - Medium, 4.75"', 34, 'toy', 5, 'For your little angel--or devil-- JW® Good & Bad Cuz is a top-selling toy. This marvelous non-toxic natural rubber ball with feet will be your dogs new best friend! The Cuz® is a resilient unique toy with a tough squeaker and a formidable bounce. Designed to withstand the toughest play. The Cuz toy is designed so there is no choking hazard posed by the squeaker. Made from non-toxic durable natural rubber. This toy has an erratic bounce pattern when thrown. Ships in a variety of random fun bright colors.', 'https://www.petproducts.com/static/upload/products/assorted/jw-pet--good-cuz-rubber-squeaker-dog-toy-medium-475/nlidnaa.jpg'),
    (58, 'Spot Skinneeez Leather Snake Toy, 25"', 46, 'toy', 10, 'Skinneeez Leather Snake Dog Toy has 3 layers of fused super durable leather for those heavy chewers. Lots of stuffing free fun with 2 squeakers to keep your puppy entertained. 3 Layers of Fused Leather for Extra Durability No Stuffing 2 Squeakers Large Enough For Your Pup to Throw Around Natural leather Smell', 'https://www.petproducts.com/static/upload/products/spot-skinneeez-leather-snake-toy-25/077234543924.jpg'),
    (59, 'Spot Beefy Brutes Durable Dog Toy - Assorted Characters, 10"', 39, 'toy', 16, 'Spot Beefy Brutes Durable Dog Toy have double stitched seams and a reinforced binding for even the roughest and toughest players. These tough guys are 10" with an added squeaker for even more fun! Made of Heavy Duty Canvas Double Stitched Seams Reinforced Binding 10" Assorted Characters ~ We''ll choose one for you!', 'https://www.petproducts.com/static/upload/products/spot-beefy-brutes-durable-dog-toy---assorted-characters-10/beefy%20brutes.jpg'),
    (60, 'Outward Hound Dog Smart Puzzle, Level 1', 16, 'toy', 15, 'Fights boredom by keeping your dog busy Helps reduce destructive behavior like chewing digging and excessive barking Fun for all dogs-regardless of age size or breed Easy to clean', 'https://www.petproducts.com/static/upload/products/outward-hound-dog-smart-puzzle-level-1/700603673310.jpeg'),
    (61, 'Outward Hound Nina Ottoson Dog Tornado Puzzle, Level 2', 48, 'toy', 25, 'Dog Tornado Treat Dispensing Dog Toy Brain and Exercise Game for Dogs by Nina Ottosson is a smart and fun choice for mealtime as it holds your dog''s favorite wet or dry kibble. Keeps your dog engaged and presents them with a fun and challenging way to play independently. Helps reduce destructive behavior by exercising your dog''s mind. Dog exercise toy strengthens the bond with your dog. Fun for all dogs regardless of age and size.', 'https://www.petproducts.com/static/upload/products/outward-hound-nina-ottoson-dog-tornado-puzzle-level-2/700603673327.jpg'),
    (62, 'KONG Cozie Ali the Alligator Dog Toy, X-Large', 42, 'toy', 18, 'The KONG Cozie Ali Alligator is a soft and luxuriously cuddly plush toy great for snuggle time comfort. Made with an extra layer of material for added strength, the KONG Cozie Ali Alligator is an ideal toy for softer chew sessions and indoor fun. The KONG Cozie Ali Alligator toy is sure to delight during snuggle and playtime!', 'https://www.petproducts.com/static/upload/products/assorted/kong--cozie-ali-the-alligator-dog-toy-x-large/v5s72xs.jpg'),
    (63, 'KONG Cozie Marvin the Moose Dog Toy, X-Large', 43, 'toy', 15, 'The KONG Cozie Marvin Moose is a soft and luxuriously cuddly plush toy great for snuggle time comfort. Made with an extra layer of material for added strength, the KONG Cozie Marvin Moose is an ideal toy for softer chew sessions and indoor fun. The KONG Cozie Marvin Moose toy is sure to delight during snuggle and playtime.', 'https://www.petproducts.com/static/upload/products/assorted/kong--cozie-marvin-the-moose-dog-toy-x-large/sdf4k6y.jpg'),
    (64, 'KONG Marathon Chicken Flavored Dog Chew Large, 2 ct', 32, 'toy', 6, 'The KONG Marathon treat provides a mentally occupying chew solution. Ideally sized to fit within KONG Classic rubber toys, this convenient, mess-free treat is packed full of fun. As a starter, flavor nubs ignite natural chewing instincts, then the robust exterior continues the engagement, finally, the edible prongs entice foraging instincts as they drop into the toy once the exterior is chewed. KONG Marathon is natural, grain-free, and proudly made in the USA. Placing the treat on the KONG is easy, just simply push and twist the treat to lock it on the KONG and unleash the treating extravaganza.', 'https://www.petproducts.com/static/upload/products/assorted/kong--marathon-chicken-flavored-dog-chew-large-2-ct/pydrg42.jpg'),
    (65, 'KONG Marathon Chicken Flavored Dog Chew Medium, 2 ct', 15, 'toy', 5, 'The KONG Marathon treat provides a mentally occupying chew solution. Ideally sized to fit within KONG Classic rubber toys, this convenient, mess free treat is packed full of fun. As a starter, flavor nubs ignite natural chewing instincts, then the robust exterior continues the engagement, finally the edible prongs entice foraging instincts as they drop into the toy once the exterior is chewed. KONG Marathon is natural, grain-free and proudly made in the USA. Placing the treat on the KONG is easy, just simply push and twist the treat to lock it on the KONG and unleash the treating extravaganza.', 'https://www.petproducts.com/static/upload/products/assorted/kong--marathon-chicken-flavored-dog-chew-medium-2-ct/sgub5ki.jpg'),
    (66, 'KONG Woozles Sqeaking Dog Toy, Medium, Blue', 32, 'toy', 11, 'KONG Woozles unique texture and shape are ideal for natural shaking instincts. These space-age characters are sure to delight dogs and the reinforced material is ideal for long-lasting indoor play sessions. These adorable alien buddies have multiple squeakers to keep dogs engaged for long bouts of healthy exercise.', 'https://www.petproducts.com/static/upload/products/assorted/kong--woozles-sqeaking-dog-toy-medium-blue/qtfxhsm.jpg'),
    (67, 'KONG Wild Knots Bear Assorted Colors, X-Large', 42, 'toy', 13, 'KONG Wild Knots are soft and cuddly on the outside while durable and strong on the inside. Wild Knots bears are sure to be a hit with dogs and their pet parents. Dogs love the knotted skeleton, and the reinforced plush body provides extra durability. KONG Wild Knots have less stuffing for less mess and they squeak to entice play.', 'https://www.petproducts.com/static/upload/products/assorted/kong--wild-knots-bear-assorted-colors-x-large/ec7rp42.jpg'),
    (68, 'KONG Floppy Knots Elephant Dog Toy, S/M', 40, 'toy', 11, 'KONG Floppy Knots are the newest arrival in the Knots tribe with a cheerful, floppy design allowing for great thrashing fun. The realistic feel of the internal knotted rope satisfies natural instincts while the varied textures and squeakers gear up for play. With minimal stuffing for less mess get ready for entertaining games and grins.', 'https://www.petproducts.com/static/upload/products/assorted/kong--floppy-knots-elephant-dog-toy-s-m/hx8cru4.jpg'),
    (69, 'KONG Occasions Red Birthday Balloon Dog Toy, Medium', 22, 'toy', 7, 'Celebrate with a squeak and shake with a festive fetch toy that cranks up the fun for your little party animal! KONG Birthday Balloons long rope flips and flops for a fiesta of shaking thats way more satisfying to your pup than blowing out silly candles. Crinkling and squeaking sounds keep your dog engaged in healthy, active romping with a birthday balloon that never deflates.', 'https://www.petproducts.com/static/upload/products/assorted/kong--occasions-red-birthday-balloon-dog-toy-medium/ib30cjf.jpg'),
    (70, 'KONG Occasions Birthday Ball Dog Toy, Medium, 2 ct', 29, 'toy', 8, 'KONG Birthday Ball delivers a bouncing, squeaking fetching fiesta to party animals who love to chase and retrieve. The squeaker helps gets the party started and helps keep your pup engaged in healthy active play that strengthens the bond between you and your pup. Celebrate birthdays or any day when you have your dog by your side with a party favor that cranks up the canine fun on any occasion.', 'https://www.petproducts.com/static/upload/products/assorted/kong--occasions-birthday-ball-dog-toy-medium-2-ct/k8wuhjy.jpg'),
    (71, 'KONG Signature Ball Dog Toy Large, 2 ct', 49, 'toy', 11, 'The KONG Signature ball brings ultra-durability and an uber-bounce to games of fetch and retrieve. Dogs that are driven to fetch will delight in play sessions with the KONG Signature Ball and with a durable construction its sure to last for those dogs that can never get enough retrieving fun.', 'https://www.petproducts.com/static/upload/products/assorted/kong--signature-ball-dog-toy-large-2-ct/0e1bpzk.jpg'),
    (72, 'KONG Bounzer Ultra Dog Toy, Large', 31, 'toy', 19, 'The KONG Ultra Bounzer is uniquely designed to meet the needs of dogs that never get enough fetching fun. The Ultra Bounzer is made out of durable material making it last longer, while the classic KONG silhouette shape creates an unpredictable bounce. The KONG Ultra Bounzer compresses and rebounds to its original shape over and over again while a dog plays, making it an ideal toy for independent fun. The top handle makes it easy for tug and toss interactive play as well.', 'https://www.petproducts.com/static/upload/products/assorted/kong--bounzer-ultra-dog-toy-large/oow7obm.jpg'),
    (73, 'KONG Cozie Ultra Max Moose Dog Toy, Large', 34, 'toy', 14, 'The KONG Cozie Ultra Moose uses KONG Ultra-Tex fabric construction, which combines ultra-durable technology that uniquely supports action-packed fun. The ripstop material and reinforced seams are supported with a robust interior liner and is designed to fulfill a dogs natural hunting and chewing instincts. Multiple reinforcements, including five times more stitching, add strength and durability ensuring that long-lasting fun is supported. Add to that internal squeakers and dense levels of stuffing and this toy is sure to keep playtime going and going and going.', 'https://www.petproducts.com/static/upload/products/assorted/kong--cozie-ultra-max-moose-dog-toy-large/xwbayj5.jpg'),
    (74, 'KONG Cozie Ultra Ana Alligator Dog Toy, Large', 37, 'toy', 14, 'The KONG Cozie Ultra Alligator uses KONG Ultra-Tex fabric construction, which combines ultra-durable technology that uniquely supports action-packed fun. The ripstop material and reinforced seams are supported with a robust interior liner and is designed to fulfill a dogs natural hunting and chewing instincts. Multiple reinforcements, including five times more stitching, add strength and durability ensuring that long-lasting fun is supported. Add to that internal squeakers and dense levels of stuffing and this toy is sure to keep playtime going and going and going.', 'https://www.petproducts.com/static/upload/products/assorted/kong--cozie-ultra-ana-alligator-dog-toy-large/29tnx6f.jpg'),
    (75, 'KONG Cozie Ultra Ella Elephant Dog Toy, Large', 16, 'toy', 14, 'The KONG Cozie Ultra Elephant uses KONG Ultra-Tex fabric construction, which combines ultra-durable technology that uniquely supports action-packed fun. The ripstop material and reinforced seams are supported with a robust interior liner and is designed to fulfill a dogs natural hunting and chewing instincts. Multiple reinforcements, including five times more stitching, add strength and durability ensuring that long-lasting fun is supported. Add to that internal squeakers and dense levels of stuffing and this toy is sure to keep playtime going and going and going.', 'https://www.petproducts.com/static/upload/products/assorted/kong--cozie-ultra-ella-elephant-dog-toy-large/6wplpkl.jpg'),
    (76, 'KONG Sherps Llama Dog Toy, Medium', 35, 'toy', 13, 'The KONG Sherps Llama dog toy is all packed up with an irresistibly soft plush material for the snuggles essential to every playtime expedition, these double-layered squeaky, crinkly adventure buddies are ideal for indoor actionfrom sofa summits to basement treks. An added squeaker entices and extends the fun.', 'https://www.petproducts.com/static/upload/products/assorted/kong--sherps-llama-dog-toy-medium/vawlk2u.jpg'),
    (77, 'Kong Air Kong Squeakers Tennis Balls, Large, 1 ct', 39, 'toy', 5, 'KONG Air Dog Squeakair Tennis Balls are just what they look like 100% pure tennis balls made in the same factory, using the same materials as any high-quality tennis balls. Air KONG Squeaker units are hidden and covered by the tennis ball material.', 'https://www.petproducts.com/static/upload/products/assorted/kong--air--squeakers-tennis-balls-large-1-ct/pku669k.jpg'),
    (78, 'KONG Squeakair Birthday Tennis Balls, Medium, 3 ct', 38, 'toy', 6, 'The KONG SqueakAir Ball combines two classic dog toys - the tennis ball and the squeaker toy - to create the perfect fetch toy. Our durable, high-quality SqueakAir Tennis Ball will not wear down your dog''s teeth. It''s made with special non-abrasive felt.', 'https://www.petproducts.com/static/upload/products/assorted/kong--squeakair-birthday-tennis-balls-medium-1-ct/jczxqwr.jpg'),
    (79, 'Spot Fun Sloth Plush Dog Toy Assorted Colors, 13"', 30, 'toy', 13, 'Dogs of all kinds will love the Spot Fun Sloth Plush Dog Toy. This cute and shaggy sloth is soft and squishy and supremely huggable! With a noisy squeaker and stubby body, this fun little guy works great for toss and fetch or even solo play. His extra soft plush exterior makes him wonderful for snuggle, time, too.', 'https://www.petproducts.com/static/upload/products/assorted/spot--fun-sloth-plush-dog-toy-assorted-colors-13/d9umniy.jpg'),
    (80, 'Spot Rattle Snake Plush Dog Toy, 24"', 15, 'toy', 7, 'Dogs of all kinds will enjoy the Spot Pet Rattler Snake Dog Toy! These snaky buddies measure a full two feet long and are great for stalking, shaking, and throwing in the air. With a squeaker in the head, crinkle paper in the body, and a tail that actually rattles, these sneaky serpents will get your favorite snake hunter crazy excited! They come in several assorted colors with realistic snake prints your dog will love.', 'https://www.petproducts.com/static/upload/products/assorted/spot--rattle-snake-plush-dog-toy-24/42ep3ml.jpg'),
    (81, 'Spot Roll-a-Treat Dog Treat Dispenser', 11, 'toy', 5, 'Roll about and treats fall out! Roll-A-Treat can be used as a food/treat dispenser or a slow feeder. Cap screws off for loading and cleaning. Three rods inside to divert food. Keeps dogs mentally challenged.', 'https://www.petproducts.com/static/upload/products/assorted/spot--roll-a-treat-dog-treat-dispenser/nrfu90k.jpg'),
    (82, 'Spot Press and Pull Interactive Dog Toy Assorted Colors', 13, 'toy', 10, '2-in-1 Ball & Rope Interactive Dog Toy - Super Strong sticks to smooth flat surfaces and keeps your dog active and entertained.', 'https://www.petproducts.com/static/upload/products/assorted/spot--press-and-pull-interactive-dog-toy-assorted-colors/ft42hbn.jpg'),
    (83, 'Spot Fun Drink Pupsi Soda Plush Dog Toy', 13, 'toy', 7, 'Fun Drink Pupsi allows dogs to have a beverage with their chips! Durable poly nylon fabric with crinkle paper and a squeaker.', 'https://www.petproducts.com/static/upload/products/assorted/spot--fun-drink-pupsi-soda-plush-dog-toy/fvjxvu5.jpg'),
    (84, 'Spot Fun Drink Heinekennel Plush Dog Toy', 31, 'toy', 7, 'Fun Drink Heinekennel allows dogs to have a beverage with their chips! Durable poly nylon fabric with crinkle paper and a squeaker', 'https://www.petproducts.com/static/upload/products/assorted/spot--fun-drink-heinekennel-plush-dog-toy/mzvy6uq.jpg'),
    (85, 'Spot Fun Drink Red Ball Plush Dog Toy', 21, 'toy', 7, 'Fun Drink Red Ball allows dogs to have a beverage with their chips! Durable poly nylon fabric with crinkle paper and a squeaker.', 'https://www.petproducts.com/static/upload/products/assorted/spot--fun-drink-red-ball-plush-dog-toy/fvji9rk.jpg'),
    (86, 'Spot Fun Drink Pupland Springs Plush Dog Toy', 23, 'toy', 7, 'Fun Drink Pupland Spring allows dogs to have a beverage with their chips! Durable poly nylon fabric with crinkle paper and a squeaker.', 'https://www.petproducts.com/static/upload/products/assorted/spot--fun-drink-pupland-springs-plush-dog-toy/640u11t.jpg'),
    (87, 'Spot Fun Food Ruffus Chips Plush Dog Toy', 45, 'toy', 8, 'Fun Foods Chips parodies real chips! Realistic designs on durable fabric with crinkle paper and a squeaker inside! 100% fun and 0 calories! Jumbo size for even more fun!', 'https://www.petproducts.com/static/upload/products/assorted/spot--fun-food-ruffus-chips-plush-dog-toy/blm9fp4.jpg'),
    (88, 'Spot Scent-Sation Peanut Butter Scented Bone, 6"', 29, 'toy', 9, 'Super durable TPR dog toys infused with peanut butter flavor. Nubs massage teeth and gums for a healthy mouth.', 'https://www.petproducts.com/static/upload/products/assorted/spot--scent-sation-peanut-butter-scented-bone-6/miarn97.jpg'),
    (89, 'Spot Yo Llama Plush Dog Toy Assorted Colors', 45, 'toy', 9, 'Super cute Llama dog toy. Multi-textured plush with a squeaker inside. Easy to pick up or cuddle with. 3 assorted colors', 'https://www.petproducts.com/static/upload/products/assorted/spot--yo-llama-plush-dog-toy-assorted-colors/w6uygxg.jpg'),
    (90, 'Spot Luna-Corn Plush Dog Toy Assorted Colors', 11, 'toy', 9, 'Spot Luna-Corn Plush Dog Toy is soft and fun to play with your dog or puppy. Rainbow colored unicorn comes in an assortment of colors.', 'https://www.petproducts.com/static/upload/products/assorted/spot--luna-corn-plush-dog-toy-assorted-colors/2q99alw.jpg'),
    (91, 'Spot Fun Candy Grabbers Plush Dog Toy', 10, 'toy', 7, 'Fun Candy is the perfect addition to our drinks and chips. Durable fabric with digital printing design. Crinkle paper inside gives it the "crunch" effect dogs love.', 'https://www.petproducts.com/static/upload/products/assorted/spot--fun-candy-grabbers-plush-dog-toy/eqnu8l6.jpg'),
    (92, 'Four Paws Quick Blood Stopper Antiseptic Styptic Powder - .5 oz', 23, 'grooming', 5, 'Four Paws Antiseptic Quick Blood Stopper is designed to be used by both veterinarians and breeders in the aid of stopping blood when docking, cropping and / or nail cutting.', 'https://www.petproducts.com/static/upload/products/assorted/four-paws--quick-blood-stopper-antiseptic-styptic-powder-5-oz/rvmgrmf.jpg'),
    (93, 'Four Paws Magic Coat Tangles & Mats Shampoo - 16 oz', 44, 'grooming', 11, 'Magic Coat® Tangles and Mats Shampoo is specially formulated with vitamin rich aloe vera providing deep moisturizing effects that strengthen and detangle the dog''s coat. It soften''s the coat leaving it manageable and easy to brush or comb. 16 oz. (473ml)', 'https://www.petproducts.com/static/upload/products/central-garden+pet-company/four-paws--magic-coat-good-by-tangles-16oz/MC_Tangles_and_mats_Shampoo.jpg'),
    (94, 'Espree 50:1 Doggone Clean Shampoo - 1 gallon', 17, 'grooming', 70, 'Espree 50:1 Doggone Clean Professional Strength Shampoo is highly concentrated for extra cleaning power and longevity in each bottle. This natural pet shampoo is made with 100% organically grown Aloe Vera and safe to use with flea treatments.Add to Cart', 'https://www.petproducts.com/static/upload/products/espree/espree--501-doggone-clean-shampoo-22-oz/espree_50_to_1_gallon_shampoo.png'),
    (95, 'Bio-Groom Fluffy Puppy Shampoo - 12 oz', 36, 'grooming', 16, 'Developed especially for a puppys sensitive skin and delicate coat, this pure and natural conditioning shampoo cleanses thoroughly and effortlessly without stripping the natural protective oils from skin and coat.It rinses out quickly and completely for those impatient puppies. Help control body odors, is pH balanced and leaves no irritating residue.', 'https://www.petproducts.com/static/upload/products/bio-groom/bio-groom-fluffy-puppy-shampoo-22-oz/biogroom_dog_shampoo_fluffypuppy_12oz-.png'),
    (96, 'Bio Groom Groom N Fresh Shampoo - 12 oz', 25, 'grooming', 15, 'The unique fragance in Groom ''n Fresh has been specially selected from the finest most prestigious perfume oil in the world. This mild, soap free natural shampoo cleanses thoroughly, effortlessly, without stripping natural protective oils from skin and coat.', 'https://www.petproducts.com/static/upload/products/bio-groom/bio-groom-groom-n-fresh-shampoo-22-oz/biogroom_dog_shampoo_groomnfresh.png'),
    (97, 'Bio-Groom Mink Oil Spray - 12 oz', 26, 'grooming', 21, 'Enriched with Vitamin E, Mink Oil Spray gives the hair a beautiful deep down luster and sheen with one application. It thoroughly conditions coat and skin, while special sunscreens help protect hair from sun damage, bleaching, drying, and breakage. It promotes healthy coat development and growth, leaving the coat manageable and show ring ready. Non-sticky, non-greasy, non-aerosol.', 'https://www.petproducts.com/static/upload/products/assorted/bio-groom--mink-oil-spray-12-oz/v7mj5hc.jpg'),
    (98, 'Bio-Groom Natural Oatmeal Cream Rinse - 12 oz', 16, 'grooming', 15, 'This all natural conditioning treatment helps relieve dry irritated skin. Natural Oatmeal Creme Rinse gives the coat remarkable sheen and a silky feel. Formulated with natural colloidal oatmeal, it moisturizes overworked hair and removes tangles to prevent damage from pulling and tugging. Made in the USA.', 'https://www.petproducts.com/static/upload/products/assorted/bio-groom--natural-oatmeal-cream-rinse-12-oz/lgf8xbm.jpg'),
    (99, 'Bio-Groom Natural Scents Wild Honeysuckle Shampoo - 12 oz', 35, 'grooming', 14, 'Bio-Groom Natural Scents shampoos are presented as our invitation to come grow with us. Created to stir the senses, Bio Groom Natural Scents captivate by sight, smell and experience! Our bottles enchant and catch the eye. Made from natural ingredients with added Chamomile and Aloe Vera, shampoos are mild and soap free. They clean thoroughly and rinse effortlessly leaving the coat soft, shiny, and with a natural, clean exciting scent.', 'https://www.petproducts.com/static/upload/products/bio-groom/bio-groom-natural-scents-wild-honeysuckle-shampoo-22-oz/biogroom_dog_shampoo_wildhoneysuckle.png'),
    (100, 'Bio-Groom Oatmeal Shampoo - 12 oz', 11, 'grooming', 15, 'This all natural soap free cleansing treatment helps relieve dry irritated skin. This exceptional shampoo cleans the skin and coat without harsh irritating chemicals. Special conditioners moisturize and soothe the skin on dogs and cats.', 'https://www.petproducts.com/static/upload/products/bio-groom/bio-groom--oatmeal-shampoo-12-oz/biogroom_dog_shampoo_naturaloatmeal_12oz.png'),
    (101, 'Bio-Groom Silk Cream Rinse Conditioner - 12 oz', 50, 'grooming', 14, 'Shows off an unforgettable shiny and smooth coat with silk. It is fortified with Chamomile, nature''s own stimulating hair and skin conditioner, and leaves hair looking and feeling it''s best. Silk provides beautiful body, fullness, resiliency, and texture to the coat. It moisturizes overworked hair, removes tangles, and rinses out clean, making hair easy to manage. Silk is designed for use on all coat colors, including white. It is anti-static, PH balanced, biodegradable, and fresh smelling.', 'https://www.petproducts.com/static/upload/products/assorted/bio-groom--silk-cream-rinse-conditioner-12-oz/18amog3.jpg'),
    (102, 'Bio-Groom So-Gentle Hypo-Allergenic Shampoo - 12 oz', 16, 'grooming', 15, 'So-Gentle is tearless and soap-free! It is mild enough for even the most sensitive pets. Scientifically formulated, So-Gentle is free of perfumes and dyes and will not leave an irritating residue. Derived from natural re-growable sources such as corn, coconut, and palm kernel oils. It has been extensively tested to ensure the utmost in mildness for skin and eyes by in-vitro methods, a non-animal testing procedure.', 'https://www.petproducts.com/static/upload/products/bio-groom/bio-groom--so-gentle-hypo-allergenic-shampoo-12-oz/Bio_Groom_so_gentle_hypo_allergenic_shampoo.png'),
    (103, 'Bio-Groom Waterless Bath Tearless No Rinse Shampoo - 8 oz', 30, 'grooming', 13, 'Super Blue Plus Waterless Shampoo', 'https://www.petproducts.com/static/upload/products/bio-groom/bio-groom--super-blue-plus-shampoo-8-oz/Biogroom_waterless_shampoo.png'),
    (104, 'Bio-Groom Super White Shampoo - 12 oz', 30, 'grooming', 15, 'Bio-Groom Super White Shampoo highlights colors and makes the white sparkle. Gentle, mild shampoo fortified with protein to give life and body to the coat. Color enhancers intensify and add depth and dimension to coat colors. Tearless, has a neutral pH. Conditions, rinses easily.', 'https://www.petproducts.com/static/upload/products/bio-groom/bio-groom-super-white-shampoo-22-oz/biogroom_dog_shampoo_superwhite_12oz.png'),
    (105, 'Bio-Groom Ultra Black Color Enhanced Shampoo - 12 oz', 10, 'grooming', 15, 'Tearless Color Enhancing Shampoo. This special formula contains pearlescent brighteners to intensify black, blue, and other dark colored coats, creating sparkling accents and a rich lustrous sheen. The mild Coconut Oil base is enriched with Protien to give life and body to the coat. Has a neutral pH, a fresh, clean scent, and rinses out in seconds.', 'https://www.petproducts.com/static/upload/products/bio-groom/bio-groom--ultra-black-color-enhancer-shampoo-tearless-12-oz/Bio_Groom_Ultra_Black_Shampoo.png'),
    (106, 'Bio-Groom Wiry Coat Texturizing Shampoo - 12 oz', 21, 'grooming', 15, 'For the wiry terrier type breeds, Wiry Coat adds the desired coarseness needed for perfection. While texturizing, it cleans, deodorizes, and adds body without damaging the hair. It will highlight all colors. The fresh scented lather rinses out quickly. Neutral pH, and may be diluted 4 to 1.', 'https://www.petproducts.com/static/upload/products/bio-groom/bio-groom--wiry-coat-shampoo-12-oz/Bio_Groom_Wiry_Coat_shampoo.png'),
    (107, 'JW Pet Gripsoft Delux Nail Clippers - Medium', 23, 'grooming', 8, 'Less chance of over-cutting the nails with JW''s Nail Guard for that extra piece of protection', 'https://www.petproducts.com/static/upload/products/assorted/jw-pet--gripsoft-delux-nail-clippers-medium/sr4ppui.jpg'),
    (108, 'JW Pet Gripsoft Nail Clipper', 43, 'grooming', 5, 'Never worry about those overgrown nails again', 'https://www.petproducts.com/static/upload/products/assorted/jw-pet--gripsoft-nail-clipper/3hgk572.jpg'),
    (109, 'Li''l Pals Nail Trimmer', 49, 'grooming', 7, 'Perfectly proportioned to meet the needs of your petite pet, this Li''l Pals? trimmer is made of high quality materials and is perfect clipping trimming little claws. For that finishing touch, always smooth away rough edges for the Li''l Pals petite nail trimmer.', 'https://www.petproducts.com/static/upload/products/assorted/lil-pals--nail-trimmer/mpdtiz6.jpg'),
    (110, 'Natural Chemistry Flea & Tick Oatmeal Shampoo - 16 oz', 20, 'grooming', 15, 'Natural Flea & Tick Shampoo with Oatmeal for Dogs contains natural botanical ingredients that work synergistically with one another to provide effective and natural flea protection. Natural Flea & Tick Shampoo with Oatmeal for Dogs has been proven to provide a residual effect for up to 7 days and is also effective on black flies and mosquitoes. Another added benefit is oatmeal proteins which moisturize, nourish and revitalize dry coats.', 'https://www.petproducts.com/static/upload/products/assorted/natural-chemistry--flea+tick-oatmeal-shampoo-16-oz-/ijnk187.jpg'),
    (111, 'Miracle Care Natural Flea and Tick Shampoo - 16.9 oz', 41, 'grooming', 14, 'Miracle Care Natural Flea and Tick Shampoo treats fleas, tick and lice with natural pesticides. This product never loses its effectiveness and won''t wash out other flea and tick control products. It effectively works on insects at all stages of the life cycle, including eggs, larvae, pupae and adults. Use on dogs and puppies of any age and size!', 'https://www.petproducts.com/static/upload/products/natural-chemistry-flea--tick-shampoo-for-dogs---169-oz/miracle-care-natural-flea-and-tick-shampoo.jpg'),
    (112, 'Safari Stainless Steel Nail Trimmer', 25, 'grooming', 7, 'The Safari Nail Trimmer is ideal for small dogs and puppies. It features a comfortable grip handle and is made from the finest quality Stainless Steel for a long-lasting, sharp cutting edge.', 'https://www.petproducts.com/static/upload/products/assorted/safari--stainless-steel-nail-trimmer/1i16mhe.jpg'),
    (113, 'Safari Dematting Comb', 32, 'grooming', 13, 'The Safari De-Matting Comb will help remove mats and tangles from your pet''s coat. The stainless steel, serrated blades will comb out most tangles. The De-Matting Comb can be used on most medium to longhaired pets. It is especially helpful on coarse or long, matted coats.', 'https://www.petproducts.com/static/upload/products/assorted/safari--dematting-comb/wguzbe3.jpg'),
    (114, 'Safari Guilliotine Nail Trimmer', 38, 'grooming', 9, 'The Safari Guillotine Trimmer is made from the finest quality Stainless Steel for a long-lasting, sharp cutting edge. Nail trimming should be a regular part of your pet''s grooming. It is important to your pet''s well-being to keep the nails properly trimmed. This product may be used with all types of breeds.', 'https://www.petproducts.com/static/upload/products/assorted/safari--guilliotine-nail-trimmer/cqo2baw.jpg'),
    (115, 'Safari Professional Nail Clipper - Small', 44, 'grooming', 12, 'The Safari Professional nail trimmer is made from the finest quality Stainless Steel which will give a long-lasting, sharp cutting edge. Nail trimming should be a regular part of your pet''s grooming. It is important to your pet''s well-being to keep the nails properly trimmed. This product is best suited for medium to large dogs.', 'https://www.petproducts.com/static/upload/products/assorted/safari--professional-nail-clipper-small/fjalxgv.jpg'),
    (116, 'Vet''s Best Hot Spot Shampoo, 16 oz', 11, 'grooming', 18, 'Veterinarians Best Hot Spot Shampoo with Tea Tree Oil was developed by a veterinarian to give your pet fast relief. A special combination of natural moisturizing and rejuvenating ingredients soothes dry skin, removes dandruff flakes, and provides fast relief from itch.', 'https://www.petproducts.com/static/upload/products/vets-best/vets-best-hot-spot-itch-relief-shampoo-for-dogs-224-oz/vets_best_hot_spot_shampoo.jpg'),
    (117, 'Evolution Double Row Undercoat Rake with Rotating Pins', 44, 'grooming', 10, 'The Evolution Undercoat Grooming Rake is the perfect tool for clearing loose fur and preventing matting in your dog''s undercoat. With 20 rotating metal pins that pull through the coat without causing damage, this rake is designed for breeds with thick, heavy coats.', 'https://www.petproducts.com/static/upload/products/assorted/evolution--double-row-undercoat-rake-with-rotating-pins/bzyj54r.jpg'),
    (118, 'Gimborn Kwik Stop Styptic Powder', 26, 'grooming', 7, 'Best selling styptic powder stops bleeding on minor cuts, nail clippings, and tail dockings faster than all others. Contains Benzedrine and helps stop bleeding fast. Safe for Dogs, Cats and Birds. DIRECTIONS: Apply with moistened cotton applicator to the nail or other superficial bleeding area using moderate pressure for 5 to 10 seconds.', 'https://www.petproducts.com/static/upload/products/assorted/miracle-care-gimborn-kwik-stop-styptic-powder/11j8y1h.jpg'),
    (119, 'Bio-Groom Protein Lanolin Shampoo - 12 oz', 34, 'grooming', 28, 'This unique formula will highlight all colors and make the coat shine! With a baby-mild, coconut oil base, it will thoroughly clean without stripping natural oils from skin and coat. Prevents dryness, rinses out completely leaving no irritating residue. Hair dries smooth, manageable, and tangle-free. pH balanced and biodegradable. Safe for puppies and kittens.', 'https://www.petproducts.com/static/upload/products/bio-groom/bio-groom--protein-lanolin-shampoo-12-oz2/Bio_Groom_Protein_Lanolin_Shampoo.png'),
    (120, 'JW Gripsoft Palm Nail Grinder for Dogs', 46, 'grooming', 17, 'Cordless, ergonomic trimmer fits in the palm of your hand Varying speed controls & 2 filing grits to suit all dogs LED light provides better visibility Nail guard protects hair & catches filings', 'https://www.petproducts.com/static/upload/products/jw-gripsoft-palm-nail-grinder-for-dogs/029695650611.jpg'),
    (121, 'Four Paws Magic Coat Total Knot Destroyer', 20, 'grooming', 9, 'Safely remove stubborn knots and mats with our Magic Coat Professional Series Total Knot Destroyer! This dog knot comb is a total solution that was thoughtfully designed to remove any knot—even in the most hard-to-reach, sensitive areas. This multi-purpose grooming comb features a recessed cutting blade to thin out excess hair and safely eliminate tough mats and knots. To reach even deeper knots, our dematter includes a comb extender for more precise grooming, especially in longer-haired coats! With a handle ergonomically designed for comfort, this pet grooming tool is ideal for both dogs and cats with medium, long, and curly coats. 3-in-1 dog knot comb effectively works through knots, tangles, and mats Recessed blade cuts through the toughest mats Includes comb extension attachment for precise grooming in hard-to-reach and sensitive areas Fine tooth comb detangles and smooths the undercoat Ergonomic handle for ultimate comfort and control Designed for dogs and cats with medium, long, and curly coat types', 'https://www.petproducts.com/static/upload/products/central-garden+pet-company/-four-paws-magic-coat-total-knot-destroyer/045663975586.jpg'),
    (122, 'Bio Groom Vita Oil Coat Oil Conditioner for Dogs, 16 oz', 38, 'grooming', 35, 'Bio Groom Vita Oil Coat Oil Conditioner has the finest blend of wheat germ oil, lanolin oil, and essential vitamin E. Completely dissolves in water and washes out easily. No alcohol or silicone.', 'https://www.petproducts.com/static/upload/products/assorted/bio-groom-bio-groom-vita-oil-coat-oil-conditioner-for-dogs-16-oz/g0wao72.jpg'),
    (123, 'Four Paws Magic Coat Professional 2-in-1 Quick Shed Grooming Tool', 40, 'grooming', 14, 'The Magic Coat 2-in-1 Quick Shed Pet Grooming Tool is an adjustable grooming tool that effortlessly demats and desheds your pet''s coat with only one multifunctional tool. Perfect for both cats and dogs, this pet dematting tool eliminates tangles while also removing loose, dead hair to promote a cleaner, healthier coat. The signature ergonomic handle on this pet groomer features a thumb grip designed to provide better control when maneuvering through hard-to-reach areas and sensitive spots-allowing you to groom your pet''s ears, tail, belly, underarms, and legs with ease. You and your pet will love adding this to your regular and trusted pet grooming tools!', 'https://www.petproducts.com/static/upload/products/assorted/four-paws--magic-coat-professional-2-in-1-quick-shed-grooming-tool/vk338js.jpg'),
    (124, 'Zymox Shampoo with Vitamin D3 for Dogs and Cats, 12 oz', 25, 'grooming', 15, 'Zymox shampoo is naturally antimicrobial due to our patented LP3 Enzyme System. Each enzyme has its own unique property, but the combination of enzymes works together to provide a powerful punch to your pets skin problems. Weve added no antibiotics, alcohol or drying ingredients, leaving your pets skin and coat, clean, smelling fresh and irritation free.', 'https://www.petproducts.com/static/upload/products/assorted/zymox--shampoo-with-vitamin-d3-for-dogs-and-cats-12-oz/7g5lh3b.jpg'),
    (125, 'Zymox Conditioning Rinse with Vitamin D3 for Dogs and Cats, 1 Gal', 15, 'grooming', 93, 'Zymox conditioner for pets is naturally antimicrobial due to our patented LP3 Enzyme System. Each enzyme has its own unique property, but the combination of enzymes works together to provide a powerful punch to your pets skin problems. Weve added no antibiotics, alcohol or drying ingredients, leaving your pets skin and coat, clean, smelling fresh and irritation free.', 'https://www.petproducts.com/static/upload/products/assorted/zymox--conditioning-rinse-with-vitamin-d3-for-dogs-and-cats-1-gal/ezg4uxd.jpg'),
    (126, 'Conairpro Comb For Dogs, Medium', 46, 'grooming', 12, 'The ConairPRO PET Comb gently and easily glides through your dog''s coat to remove knots and tangles. The ergonomic, memory gel-grip handle offers maximum control and comfort.', 'https://www.petproducts.com/static/upload/products/assorted/conairpro--comb-for-dogs-medium/2wmx5pk.jpg'),
    (127, 'Conairpro Grooming Kit For Dogs & Cats, 10 ct', 31, 'grooming', 55, 'The ConairPRO PET Home Grooming Corded Clipper Kit is a 10-piece kit that is great for light clipping and trimming on most breeds. It features a powerful DC motor and 5-detent taper lever for select cutting positions.', 'https://www.petproducts.com/static/upload/products/assorted/conairpro--grooming-kit-for-dogs+cats-10-ct/6rouizf.jpg'),
    (128, 'Conairpro Palm Pro Pet Micro Trimmer For Dogs & Cats', 20, 'grooming', 28, 'The ConairPRO PET Palm PRO Pet Micro Trimmer is ideal for trimming delicate areas such as the face, ears, paws and sanitary areas . Its quiet sound and palm-sized shape make it great for trimming all pets, especially ones that startle easily.', 'https://www.petproducts.com/static/upload/products/assorted/conairpro--palm-pro-pet-micro-trimmer-for-dogs+cats/r50m5dy.jpg'),
    (129, 'Iams Proactive Health Smart Puppy Large Breed Dry Puppy Food, 15 lbs', 47, 'food', 33, 'Iams Smart Puppy Large Breed promotes optimal growth with balanced nutrition specifically designed for large-breed puppies and essential DHA for healthy brain development and the best start possible.', 'https://www.petproducts.com/static/upload/products/iams-proactive-health-smart-puppy-large-breed-dry-puppy-food-15-lbs/019014610945-2.jpg'),
    (130, 'Iams Proactive Health Large Breed Adult Dry Dog Food, 15 lbs', 49, 'food', 33, 'Iams Large Breed delivers big with balanced nutrition and natural sources of glucosamine to support healthy joints to help your big dog seize the day.', 'https://www.petproducts.com/static/upload/products/iams-proactive-health-large-breed-adult-dry-dog-food-15-lbs/019014610976-2.jpg'),
    (131, 'Iams Proactive Health Mature Adult Large Breed Dry Dog Food, 30 lbs', 41, 'food', 47, 'Iams Mature Adult Large Breed nurtures your dog’s bones and joints through specially formulated nutrition with natural sources of glucosamine blended with fat-burning L-carnitine to help keep him fit, active, and living large.', 'https://www.petproducts.com/static/upload/products/iams-proactive-health-mature-adult-large-breed-dry-dog-food-30-lbs/019014611331-2.jpg'),
    (132, 'Iams Proactive Health Mature Adult Dry Dog Food, 29.1 lbs', 44, 'food', 60, 'Whether you''re looking for an advanced nutrition formula for your mature adult dog or simply want to give them a great-tasting kibble, IAMS PROACTIVE HEALTH Mature Adult Dry Dog Food offers the delicious flavors your dog loves and the health benefits they deserve. Our hearty dog food is made with high-quality animal proteins, such as real chicken. Our mature adult dog formula also helps promote lean muscles while our rich blend of antioxidants supports a strong immune system and healthy digestion. Plus, IAMS PROACTIVE HEALTH Dry Dog Food features naturally sourced glucosamine and chondroitin sulfate to support healthy joints and mobility. Your dog will not only feel the benefits of our most advanced dry dog food, but you also will notice healthier-looking skin and less tartar buildup. Best of all, our wholesome PROACTIVE HEALTH Food for Dogs is made using no added fillers, artificial colors, flavors or preservatives. Premium nutrition never tasted so good!', 'https://www.petproducts.com/static/upload/products/mars-petcare/-iams-proactive-health-mature-adult-dry-dog-food-291-lbs/10144763-1-Iams-Main_Image__Front_.jpg'),
    (133, 'Iams Proactive Health Adult Minichunks Dry Dog Food, 30 lbs', 12, 'food', 60, 'Satisfy your small dog''s craving for real meat proteins, and give them 100% complete and balanced nutrition with IAMS PROACTIVE HEALTH Adult Minichunks Dry Dog Food. Our hearty dog food is made with real chicken as the first ingredient. Your active dog''s favorite pet food, now in a smaller kibble size, delivers the hearty protein they need to maintain lean muscles. Plus, it includes L-carnitine to help burn fat and promote a healthy metabolism. IAMS PROACTIVE HEALTH Dog Food also is formulated with seven essential nutrients to nourish your dog''s heart. Your dog will feel the benefits of our wholesome dog food, and you will notice their healthier skin, shinier coat and reduced tartar buildup. Best of all, IAMS PROACTIVE HEALTH Food for Active Dogs is made without fillers or artificial preservatives, so you can be confident that your adult dog is getting wholesome nutrition in every small bite.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-iams-proactive-health-adult-minichunks-dry-dog-food-30-lbs/10144753-1-Iams-Main_Image__Front_.jpg'),
    (134, 'Iams Proactive Health Large Breed Adult Dry Dog Food, 30 lbs', 13, 'food', 60, 'Large breed dogs deserve a great-tasting formula that''s tailored to their specific nutritional needs. That''s why IAMS PROACTIVE HEALTH Adult Large Breed Dry Dog Food is formulated with naturally sourced glucosamine to support healthy joints. Made with hearty, real meat proteins, such as chicken as the first ingredient, it also helps maintain lean muscles. Every bowl of our wholesome dog food contains 100% complete and balanced nutrition for adult dog maintenance. Plus, IAMS PROACTIVE HEALTH is fortified with essential nutrients and antioxidants to nourish your dog''s heart and support a strong immune system. So whether you''re looking for premium nutrition designed for large breed dogs or simply want to feed your dog kibble they''ll enjoy, IAMS PROACTIVE HEALTH Adult Large Breed Dry Dog Food offers benefits to satisfy you and your dog.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-iams-proactive-health-large-breed-adult-dry-dog-food-30-lbs/10144755-1-Iams-Main_Image__Front_.jpg'),
    (135, 'Iams Proactive Health Smart Puppy Dry Puppy Food, 15 lbs', 42, 'food', 30, 'Your puppy has special nutritional needs for growth and play. That''s why the IAMS Brand created a premium nutrition formula just for puppies 1-12 months old. IAMS PROACTIVE HEALTH Smart Puppy Dry Puppy Food is formulated with omega-3 DHA to support healthy brain and vision development. Your puppy will look forward to our hearty dog food with savory poultry flavors, and you will like that real chicken is the first ingredient, which helps to build lean muscles. Best of all, our wholesome dry puppy food is enriched with essential minerals to help build strong bones and with antioxidants to support a healthy immune system. You can feel confident that you puppy''s new favorite kibble offers 100% complete and balanced nutrition for growth without using fillers. Help your puppy get started on the right paw with IAMS PROACTIVE HEALTH Dry Puppy Food.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-iams-proactive-health-smart-puppy-dry-puppy-food-15-lbs/10144741-1-Iams-Main_Image__Front_.jpg'),
    (136, 'Nutro Ultra Puppy Dry Dog Food, 30 lbs', 33, 'food', 90, 'Ultra Dry Puppy Food is made with nutrient-dense, natural ingredients that contain high levels of antioxidants and DHA to support a healthy heart, a strong immune system and healthy brain development. Best of all, this natural, dry Puppy kibble recipe is easy to chew and full of the best natural ingredients to help puppies grow big and strong.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-puppy-dry-dog-food-30-lbs/10090263-Ultra-dry-dog-front.jpg'),
    (137, 'Nutro Ultra Large Breed Puppy Dry Dog Food, 30 lbs', 23, 'food', 90, 'Ultra Large Breed Dry Puppy Food is made specifically for your large breed Puppy. The natural, wholesome ingredient blend helps keep their skin and coat healthy, and provides a strong immune system while natural sources of DHA promote healthy brain development. Since puppies come in all different shapes and sizes, this large breed Puppy food is formulated to meet the needs of big dogs and their big appetites. And, like all Ultra Puppy Foods, it is always 100% natural.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-large-breed-puppy-dry-dog-food-30-lbs/10090267-Ultra-dry-dog-front.jpg'),
    (138, 'Nutro Ultra Adult Dry Dog Food, 15 lbs', 26, 'food', 80, 'Ultra Adult Dry Dog Food is a nutrient dense, premium kibble, with all natural fruits and vegetables, such as blueberries, spinach and pomegranate. These premium ingredients provide high levels of antioxidants to give your dog a healthy heart, a strong immune system and a Shiny Coat. Like all Ultra Food for Dogs, it is made using only natural ingredients to support overall wellness, vitality and performance.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-adult-dry-dog-food-15-lbs/10090272-1-Nutro-Main_Image__Front_.jpg'),
    (139, 'Nutro Ultra Small Breed Adult Dry Dog Food, 4 lbs', 12, 'food', 26, 'Small dogs have big personalities, and they also have specific nutritional needs. Feed your small dog Ultra Small Breed Dry Dog Food, featuring an easy-to-chew kibble designed just for them. Your small breed dog will enjoy the unforgettable taste of premium ingredients, such as blueberries, cranberries and pomegranate in every bite, and you will enjoy the visible benefits from our super premium dog food blends.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-small-breed-adult-dry-dog-food-4-lbs/10090276-Ultra-dry-dog-front.jpg'),
    (140, 'Nutro Ultra Large Breed Adult Dry Dog Food, 15 lbs', 33, 'food', 80, 'Large breed dogs have specific nutritional needs. That''s why Ultra created a dry dog food recipe just for them. Made with natural sources of glucosamine and chondroitin, Ultra Large Breed Dog Food nourishes bones and joints for healthy mobility. The nutrient-rich, premium ingredients in this wholesome dog food, such as chicken, lamb and salmon protein, deliver complete and balanced nutrition in a great-tasting kibble. And, like all Ultra Adult Dog Foods, it is 100% all natural.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-large-breed-adult-dry-dog-food-15-lbs/10090320-Ultra-dry-dog-front.jpg'),
    (141, 'Nutro Ultra Adult Weight Management Dry Dog Food, 15 lbs', 17, 'food', 80, 'Nutro Ultra Adult Weight Management Dry Dog Food is formulated to help overweight and less active dogs achieve or maintain a healthy weight. Our premium dog food is made with nature''s finest ingredients to provide complete and balanced adult nutrition in every bowl while promoting the development of a lean body and healthy joins. Your dog will enjoy the unforgettable taste of premium natural ingredients!', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-adult-weight-management-dry-dog-food-15-lbs/10162673-1-Nutro-Main_Image__Front_.jpg'),
    (142, 'Nutro Ultra Adult Weight Management Dry Dog Food, 30 lbs', 15, 'food', 90, 'Ultra Weight Management Dog Food helps overweight and less active dogs achieve and maintain a healthier weight. This premium natural diet dog food features a perfect combination of three lean proteins, sun-ripened fruits and vegetables, whole grains, and pure sunflower oil to help support vital functions and a healthy immune system. Ultra Dry Dog Food, made with wholesome, natural ingredients, provides complete nutrition to help your dog live long and thrive.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-adult-weight-management-dry-dog-food-30-lbs/10090326-NUT-DWMA-30LB-BAG-FRONT-3D.jpg'),
    (143, 'Nutro Ultra Senior Dry Dog Food, 15 lbs', 33, 'food', 80, 'Ultra Senior Dog Food, made with high-quality, natural ingredients, gives aging dogs the essential nutrients they need for a healthy and active lifestyle. Formulated with vitamins and minerals, such as glucosamine and beta carotene, this adult dog food nourishes your dog''s joints for healthy mobility. Best of all, this natural dog food for mature adult dogs provides complete and balanced nutrition in every bowl.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-senior-dry-dog-food-15-lbs/10090330-Ultra-dry-dog-front.jpg'),
    (144, 'Nutro Ultra Toy Breed Adult Dry Dog Food, 4 lbs', 50, 'food', 26, 'Ultra Toy Breed Adult Dry Dog Food is formulated to meet their energy needs of small dogs weighing less than 25 pounds. Made with wholesome, natural ingredients, this premium dog food contains a blend of three lean proteins that help promote strong muscles. Plus, rich sources of omega fatty acids nourish their skin for a soft, radiant coat. Give your dog complete and balanced nutrition in a great-tasting formula with Ultra Dry Dog Food.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-ultra-toy-breed-adult-dry-dog-food-4-lbs/10097177-Ultra-dry-dog-front.jpg'),
    (145, 'Nutro Wholesome Essentials Healthy Weight Pasture-Fed Lamb & Rice Recipe Adult Dry Dog Food, 30 lbs', 28, 'food', 80, 'Nutro Adult Lite Weight Loss Diet Lamb and Rice Recipe can help adult dogs feel full and reduce their overall food intake, which can help with weight loss. This nutritionally complete, low-calorie formula is made with two primary ingredients: real Australian and New Zealand lamb and whole brown rice to help promote easier digestion. Omega-6 fatty acid (linoleic acid), zinc and B vitamins also support healthy skin and a soft, Shiny Coat.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-healthy-weight-pasture-fed-lamb+rice-recipe-adult-dry-dog-food-30-lbs/10122924_main.jpg'),
    (146, 'Nutro Wholesome Essentials Small Bites Pasture-Fed Lamb & Rice Recipe Adult Dry Dog Food, 30 lbs', 14, 'food', 80, 'Some adult dogs prefer smaller kibble for easier chewing. That’s why there''s Nutro Limited Ingredient Diet Small Bites Adult Dog Food. Using limited ingredients, such as premium Australian and New Zealand lamb and whole brown rice, this natural dog food formula helps reduce the likelihood of food sensitivity and digestive problems. Natural ingredients, such as linoleic acid, zinc, B vitamins and antioxidants, also help give your dog a healthy immune system and a soft, Shiny Coat. Best of all, Nutro Limited Ingredient Dry Dog Food is made without corn gluten, corn, wheat or soy protein. It’s a small bite with a big taste your dog will enjoy, guaranteed.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-small-bites-pasture-fed-lamb+rice-recipe-adult-dry-dog-food-30-lbs/10122928_main.jpg'),
    (147, 'Nutro Wholesome Essentials Pasture-Fed Lamb & Rice Recipe Senior Dry Dog Food, 30 lbs', 13, 'food', 80, 'Made with real lamb as the first ingredient, Nutro Senior Lamb and Rice Recipe Dog Food is the great-tasting formula that is specially designed for senior dogs. This natural dog food recipe is made with a limited number of ingredients to help minimize the risk of aggravating food sensitivities while delivering antioxidants and omega-3 fatty acids, including ALA and DHA, to promote brain, joint and cellular health. Best of all, Nutro Food for Senior Dogs is made with no artificial flavors, colors or preservatives, so you can feel confident that your dog is getting only high-quality ingredients and nutrition in every bite.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-pasture-fed-lamb+rice-recipe-senior-dry-dog-food-30-lbs/10122932_main.jpg'),
    (148, 'Nutro Wholesome Essentials Pasture-Fed Lamb & Rice Recipe Adult Dry Dog Food, 30 lbs', 27, 'food', 80, 'Using fewer ingredients can help reduce the likelihood of digestive problems and food sensitivities. That’s why Nutro Adult Lamb and Rice Recipe Dog Food is made with two primary ingredients: real Australian and New Zealand lamb and whole brown rice. This natural adult dog food has added vitamins, minerals and natural antioxidants that are vital for a healthy metabolism. Plus, the premium, natural ingredients in Nutro Dry Dog Food can all be traced back to their sources. The result is optimal nutrition your dog needs, a taste they enjoy and the visible key benefits you want. We guarantee it or your money back.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-pasture-fed-lamb+rice-recipe-adult-dry-dog-food-30-lbs/10122937_main.jpg'),
    (149, 'Nutro Wholesome Essentials Pasture-Fed Lamb & Rice Recipe Large Breed Adult Dry Dog Food, 30 lbs', 10, 'food', 80, 'For adult large breed dogs that require a limited ingredient dog food, there''s great-tasting Nutro Large Breed Lamb and Whole Brown Rice Recipe Dog Food. Offering a premium taste your dog will enjoy, this Nutro Dry Dog Food formula provides the necessary vitamins, minerals and antioxidants for a healthy metabolism, plus naturally sourced glucosamine and chondroitin to help build healthy cartilage and joints. Each bite of this natural dog food is infused with optimal levels of omega-6 fatty acid (linoleic), zinc and B vitamins to guarantee a soft coat that shines. Best of all, Nutro Food for Dogs is made with no corn gluten meal, wheat or soy protein to reduce the likelihood of aggravating food sensitivities.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-pasture-fed-lamb+rice-recipe-large-breed-adult-dry-dog-food-30-lbs/10122945_main.jpg'),
    (150, 'Nutro Wholesome Essentials Pasture-Fed Lamb & Rice Recipe Large Breed Puppy Dry Dog Food, 30 lbs', 44, 'food', 80, 'Nutro Large Breed Puppy Lamb and Whole Brown Rice Formula Dog Food is the great-tasting, natural Puppy food that is specially prepared for dogs with sensitive systems. Made with grass-fed lamb as the first ingredient, Nutro Limited Ingredient Puppy Food contains an optimal blend of proteins, fats, vitamins and minerals for a healthy metabolism, as well as naturally sourced glucosamine and chondroitin to promote strong bones and healthy joints. Made with no artificial colors, flavors or preservatives, Nutro Large Breed Dog Food gives growing dogs the nutrients they need for healthy development.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-pasture-fed-lamb+rice-recipe-large-breed-puppy-dry-dog-food-30-lbs/10122947_main.jpg'),
    (151, 'Nutro Wholesome Essentials Farm-Raised Chicken, Brown Rice & Sweet Potato Recipe Large Breed Senior Dry Dog Food, 30 lbs', 21, 'food', 75, 'Because of their larger frames, large breed dogs need high-quality proteins, healthy nutrients, such as glucosamine and chondroitin, and balanced levels of calcium and phosphorus to ensure proper muscle maintenance and healthy joints and bones. To meet their needs, Nutro Large Breed Senior Dog Food is made with real, farm raised chicken, whole grains and balanced fiber. Nutro Natural Dog Food not only offers a taste your dog will enjoy, but it also promotes healthy digestion because the simple, natural ingredients help Maximize nutrient absorption. And because it’s packed with vitamins, minerals and amino acids, your dog gets the nutrition they deserve in every bite.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-farm-raised-chicken-brown-rice+sweet-potato-recipe-large-breed-senior-dry-dog-food-30-lbs/10122949_main.jpg'),
    (152, 'Nutro Wholesome Essentials Farm-Raised Chicken, Brown Rice & Sweet Potato Recipe Puppy Dry Dog Food, 15 lbs', 35, 'food', 45, 'Make sure your Puppy gets off to a healthy start with a natural Puppy food designed for growth and development. Nutro Puppy Chicken, Whole Brown Rice and Oatmeal Recipe Dog Food, made with real, farm-raised chicken as the first ingredient, contains the amino acids necessary for building muscle and maintaining a healthy metabolism. Nutro Puppy Food is made with oatmeal for sensitive stomachs, whole brown rice for better nutrient absorption and a precise balance of calcium and phosphorus to help build strong bones and teeth. Best of all, this premium Puppy food contains no artificial flavors, colors or preservatives, so you can feel confident knowing your pup is getting only high-quality ingredients and nutrition in every bite.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-farm-raised-chicken-brown-rice+sweet-potato-recipe-puppy-dry-dog-food-15-lbs/10122956_main.jpg'),
    (153, 'Nutro Wholesome Essentials Farm-Raised Chicken, Brown Rice & Sweet Potato Recipe Large Breed Puppy Dry Dog Food, 30 lbs', 43, 'food', 75, 'Whether it is developing strong and healthy joints or ensuring overall balanced growth, large breed puppies need proper nutrition to help keep them strong and active. That’s why Nutro Large Breed Puppy Food uses naturally sourced glucosamine and chondroitin to help them build healthy cartilage. With balanced protein and fat for optimal growth, this great tasting, natural Puppy food also features U.S. farm-raised chicken for strong muscles and a healthy metabolism. Plus, whole brown rice and oatmeal provide easy digestion for large breed puppies with sensitive stomachs. They will enjoy the taste, and you will love seeing them mature into the happy, healthy dogs they were meant to be.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-farm-raised-chicken-brown-rice+sweet-potato-recipe-large-breed-puppy-dry-dog-food-30-lbs/10123052_main.jpg'),
    (154, 'Nutro Wholesome Essentials Farm-Raised Chicken, Brown Rice & Sweet Potato Recipe Adult Dry Dog Food, 30 lbs', 23, 'food', 75, 'Dogs crave hearty, natural ingredients. Give your best buddy a savory meal they will look forward to every time with Nutro Adult Chicken, Whole Brown Rice and Oatmeal Recipe Dog Food. Made with real chicken as the first ingredient, this dry dog food delivers the amino acids adult dogs need to build muscle and maintain a healthy metabolism. Nutro Food for Dogs also uses whole grains to nourish a healthy digestive system for proper nutrient absorption, including whole oatmeal, which is high in soluble fiber for sensitive stomachs, and antioxidants, plus vitamin E, for a healthy immune system and overall cellular health.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-farm-raised-chicken-brown-rice+sweet-potato-recipe-adult-dry-dog-food-30-lbs/10123053_main.jpg'),
    (155, 'Nutro Wholesome Essentials Farm-Raised Chicken, Brown Rice & Sweet Potato Recipe Senior Dry Dog Food, 30 lbs', 14, 'food', 75, 'Older dogs can experience some of the same challenges as aging humans, including mobility issues, memory loss and sensitivity to certain foods. Nutro Senior Chicken, Whole Brown Rice and Oatmeal Recipe Dog Food with the Nutro Senior Support System Formula helps replenish antioxidants older dogs need as they age. Featuring omega-3 fatty acids, ALA and DHA for brain and cellular health, this premium senior dog food is also made with real chicken, whole brown rice and oatmeal, so it is delicious and easy to digest. Bet of all, the added benefit of naturally sourced glucosamine and chondroitin helps keep their joints strong and healthy.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-farm-raised-chicken-brown-rice+sweet-potato-recipe-senior-dry-dog-food-30-lbs/10123055_main.jpg'),
    (156, 'Nutro Wholesome Essentials Healthy Weight Farm-Raised Chicken, Rice & Sweet Potato Recipe Large Breed Adult Dry Dog Food, 30 lbs', 33, 'food', 75, 'Nutro Large Breed Adult Weight Management Dog Food helps large breed dogs that are prone to weight gain maintain their ideal body condition. This lite dog food recipe, made with real chicken as the first ingredient, features natural fibers and whole grains to help dogs feel full. Nutro Large Breed Adult Weight Management Dog Food Chicken, Whole Brown Rice & Oatmeal Dog Food also contains a unique blend of amino acids, vitamins, minerals and naturally sourced nutrients, such as glucosamine and chondroitin to nourish healthy joints. Best of all, this dog food for large breed dogs promotes healthy skin and a soft coat.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-healthy-weight-farm-raised-chicken-rice+sweet-potato-recipe-large-breed-adult-dry-dog-food-30-lbs/10123066_main.jpg'),
    (157, 'Nutro Wholesome Essentials Farm-Raised Chicken, Brown Rice & Sweet Potato Recipe Puppy Dry Dog Food, 5 lbs', 29, 'food', 21, 'Nutro Puppy Chicken, Whole Brown Rice and Oatmeal Recipe contains real, farm-raised chicken to provide the amino acids necessary for building muscle and maintaining a healthy metabolism. This natural food for puppies is also made with oatmeal for sensitive stomachs, whole brown rice for better nutrient absorption and a precise balance of calcium and phosphorus to help build strong bones and teeth.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-farm-raised-chicken-brown-rice+sweet-potato-recipe-puppy-dry-dog-food-5-lbs/10123067_main.jpg'),
    (158, 'Nutro Wholesome Essentials Healthy Weight Farm-Raised Chicken, Lentils & Sweet Potato Recipe Adult Dry Dog Food, 30 lbs', 38, 'food', 75, 'Nutro Adult Lite Weight Loss Chicken, Whole Brown Rice and Oatmeal Recipe Dog Food is the great-tasting formula that helps less active and overweight dogs achieve a healthy weight. The first ingredient in this nutritionally complete, low-calorie dog food is U.S.-farm-raised chicken. Nutro Natural Dog Food also features a mix of high fiber and protein to help dogs feel full, which can reduce their food intake to aid in weight loss.', 'https://www.petproducts.com/static/upload/products/mars-petcare/-nutro-wholesome-essentials-healthy-weight-farm-raised-chicken-lentils+sweet-potato-recipe-adult-dry-dog-food-30-lbs/10123088_main.jpg'),
    (159, 'Blue Buffalo Freedom Grain Free Chicken Recipe for Adult Indoor Cats, 11 lbs', 44, 'food', 45, 'STARTS WITH REAL CHICKEN: A recipe with delicious, real chicken as the first ingredient, this dry cat food features the high-quality ingredients you can feel good about feeding your feline friend without the grains that contain gluten. GRAIN FREE CAT FOOD: BLUE Freedom grain free indoor cat food is specially formulated to help meet the unique needs of indoor cats including natural fiber sources to promote healthy digestion and carefully balanced calories to help maintain healthy body weight. WITH LIFESOURCE BITS: This formula contains BLUE’s exclusive LifeSource Bits – a precise blend of antioxidants, vitamins and minerals carefully selected by holistic veterinarians and animal nutritionists to support immune system health, life stage requirements, and a healthy oxidative balance. NATURAL CAT FOOD: BLUE dry cat food is formulated for the health and well-being of your adult cat and features the finest natural ingredients enhanced with vitamins and minerals. It never contains chicken (or poultry) by-product meals, corn, wheat, soy, artificial flavors or preservatives. NATURAL CAT FOOD: BLUE dry cat food is formulated for the health and well-being of your adult cat and features the finest natural ingredients enhanced with vitamins and minerals. It never contains chicken (or poultry) by-product meals, corn, wheat, soy, artificial flavors or preservatives.', 'https://www.petproducts.com/static/upload/products/blue-buffalo-freedom-grain-free-chicken-recipe-for-adult-indoor-cats-11-lbs/859610007073-2.jpg'),
    (160, 'Vital Essentials Freeze-Dried Grain Free Beef Nibblets, 1 lb', 48, 'food', 30, 'Your dogs knows what that they want for dinner – real meat. Locally sourced from America’s heartland, Freeze-Dried grain-free Beef Nibblets are made with the perfect blend of fresh, wholesome beef, organs and bones, just as nature intended. Serve as a complete and balanced meal, a nutritious treat, or mixed in with kibble. Give your dog the benefits of a raw food diet with the convenience of this freeze-dried entree.', 'https://www.petproducts.com/static/upload/products/vital-essentials2/-vital-essentials-freeze-dried-grain-free-beef-nibblets-1-lb/033211008947_Vital%20Essentials_Freeze-Dried%20Nibblets_Beef_1%20lb_1.png'),
    (161, 'Stella & Chewy''s Chewy''s Chicken Dinner Patties Freeze-Dried Raw Dog Food, 14 oz', 37, 'food', 36, 'Give your dog what he naturally craves with Stella & Chewy''s Chewy''s Chicken Dinner Patties Freeze-Dried Raw Dog Food. Based on the philosophy that dogs thrive on the same diet they would eat in the wild, this all-natural recipe makes it easy to feed your best friend only the good stuff. Made from sustainably-sourced ingredients and raw, single-source protein, this recipe starts with 95% cage-free chicken, organs and bone, plus 100% certified-organic fruits and vegetables—offering the benefits of raw food nutrition with the convenience of freeze-dried preparation. And to ensure the highest quality, each batch is made with care in Stella & Chewy’s own U.S.-kitchen. Key Benefits Made with cage-free chicken raised without hormones or antibiotics and 100% organic-certified fruits and vegetables. Real raw nutrition in the convenience of freeze-dried patties; serve as is or rehydrate by adding water. Formulated to mimic a canine’s natural diet; never contains grains, gluten, fillers, artificial preservatives or colorings. Complete and balanced nutrition is enhanced with probiotics to aid in healthy digestion—perfect for the pup with a sensitive stomach. Proudly made in the USA with ingredients responsibly sourced from trusted and reputable suppliers. Precautions Stella & Chewy''s products must always remain raw when feeding. Please do not cook, heat, or microwave the products. If rehydrating, use cool or warm (never hot) water. Please note patty count per bag may vary slightly due to the product being filled by weight. 5.5-oz bag: approx. 11 patties. 14-oz bag: approx. 28 patties. 25-oz bag: approx. 50 patties.', 'https://www.petproducts.com/static/upload/products/stella+chewys/-stella+chewys-chewys-chicken-dinner-patties-freeze-dried-raw-dog-food-14-oz/186011000045.jpg'),
