    (170, 'Stella & Chewy''s Duck Duck Goose Dinner Patties Freeze-Dried Raw Dog Food, 5.5 oz', 41, 'food', 20, 'Give your dog what he naturally craves with Stella & Chewy''s Duck Duck Goose Dinner Patties Freeze-Dried Raw Dog Food. Based on the philosophy that pets thrive on the same diet they would eat in the wild, the all-natural recipe makes it easy to feed your dog only the good stuff. Made from sustainably-sourced ingredients and raw protein, this recipe starts with 95% cage-free poultry, organs, and bone plus 100% certified-organic fruits and vegetables—offering the benefits of raw food nutrition with the convenience of freeze-dried preparation. And to ensure the highest quality, each batch is made with care in the USA in Stella & Chewy’s own kitchen. Key Benefits Real raw nutrition in the convenience of freeze-dried patties. Serve as is or rehydrate by adding warm water. Made in Stella & Chewy''s own USA kitchen with cage-free poultry and 100% organic-certified fruits and vegetables. Never contains grains, gluten, fillers, artificial preservatives, or colorings. Enhanced with probiotics to aid in healthy digestion—perfect for pets with sensitive stomachs. Pet parents and vets report raw feeding supports an improved appetite, digestion, immune system, teeth and gum health, skin and coat, and can help relieve allergies. Precautions Stella & Chewy''s products must always remain raw when feeding. Please do not cook, heat, or microwave the products. If rehydrating, use cool or warm (never hot) water. Please note patty count per bag may vary slightly due to the product being filled by weight. 5.5-oz bag: approx. 11 patties. 14-oz bag: approx. 28 patties. 25-oz bag: approx. 50 patties.', 'https://www.petproducts.com/static/upload/products/stella+chewys/-stella+chewys-duck-duck-goose-dinner-patties-freeze-dried-raw-dog-food-55-oz/186011000335.jpg'),
