    (190, 'Nulo Freestyle Grain Free Turkey & Sweet Potato Recipe Adult Dry Dog Food, 11 lbs', 18, 'food', 41, 'Nulo Freestyle Turkey & Sweet Potato Grain-Free recipe includes 85% animal-based proteins, which means more amino acids to fuel lean muscles. And with the low glycemic index ingredients and advanced probiotics, you’ll know your best friend is getting the nutrition they deserve. Key Benefits Grain-free adult formula that is free from chicken and egg proteins. Made from 85% animal-based proteins and low glycemic ingredients. Vitamin B6 and niacin from turkey supports energy production, while probiotics aid in digestion. Omega-3 and omega-6 fatty acids give your dog brilliant skin and coat. Calcium and phosphorus help your dog maintain strong bones, and wholesome vegetables and fruits support optimal immune health.', 'https://www.petproducts.com/static/upload/products/nulo/-nulo-freestyle-grain-free-turkey+sweet-potato-recipe-adult-dry-dog-food-11-lbs/811939020065.jpg'),
    (191, 'Nulo Freestyle Grain Free Lamb & Chickpeas Recipe Adult Dry Dog Food, 11 lbs', 34, 'food', 41, 'Our canine friends require rich protein to stay fit and healthy. This lamb & chickpeas grain-free recipe has 81% of proteins coming from real meat like lamb, turkey and salmon to help build strong muscles and bounce back from a day of play. And with the low glycemic index ingredients and advanced probiotics, you’ll know your best friend is getting the nutrition they deserve. Key Benefits Grain-free adult formula that is free from chicken and egg proteins Made from 81% animal-based proteins and low glycemic ingredients Vitamin B6 and niacin from lamb supports energy production, while probiotics aid in digestion Amino acids to support lean muscle mass and a healthy heart Calcium and phosphorus help your dog maintain strong bones and wholesome vegetables and fruits support optimal immune health', 'https://www.petproducts.com/static/upload/products/nulo/-nulo-freestyle-grain-free-lamb+chickpeas-recipe-adult-dry-dog-food-11-lbs/811939020072.jpg'),
    (192, 'Nulo Freestyle Grain Free Salmon & Peas Recipe Adult Dry Dog Food, 11 lbs', 40, 'food', 41, 'Whether it’s a run on the beach or a morning jog together, our four-legged friends need quality protein and nutrition to keep up with us. Nulo Freestyle Salmon & Peas Recipe includes 80% animal-based proteins, which means more amino acids to fuel lean muscles. And with the low-glycemic-index ingredients and advanced probiotics, you’ll know your best friend is getting the nutrition they deserve. Key Benefits Grain-free adult formula that is free from chicken and egg proteins. Made from 80% animal-based proteins and low-glycemic ingredients. Vitamin B6 and niacin from lamb supports energy production, while probiotics aid in digestion. Amino acids support lean muscle mass and a healthy heart. Calcium and phosphorus help your dog maintain strong bones, and wholesome vegetables and fruits support optimal immune health.', 'https://www.petproducts.com/static/upload/products/nulo/-nulo-freestyle-grain-free-salmon+peas-recipe-adult-dry-dog-food-11-lbs/811939020089.jpg'),
    (193, 'Nulo Freestyle Grain Free Cod & Lentils Recipe Adult Trim Dry Dog Food, 11 lbs', 16, 'food', 45, 'Staying fit and trim can be more challenging for some dogs. That’s why Nulo made the Nulo FreeStyle Adult Trim formula. This grain-free recipe of cod & lentils provides the protein and amino acids dogs need, but includes more fiber and less fat calories than the other recipes. And the addition of L-Carnitine supports the metabolism of fats. Great for all breeds and sizes that could use a little help becoming the dog they want to be. Key Benefits A grain-free and low fat formula that is free from chicken and egg proteins Made from 74% animal-based proteins and low glycemic ingredients Includes L-Carnitine to support the metabolism of fats Contains pure probiotic strains to aid in proper digestion Calcium and phosphorus help your dog maintain strong bones while wholesome vegetables and fruits support optimal immune health', 'https://www.petproducts.com/static/upload/products/nulo/-nulo-freestyle-grain-free-cod+lentils-recipe-adult-trim-dry-dog-food-11-lbs/811939020096.jpg'),
    (194, 'Nulo Freestyle Grain Free Trout & Sweet Potato Recipe Senior Dry Dog Food, 24 lbs', 42, 'food', 80, 'Treat your senior dog to a superior nutrition plan that keeps them fit and healthy for years to come. With all the benefits of a high animal meat, grain-free formula, this senior formula also includes Glucosamine and Chondroitin to support hip & joint health. And the addition of L-Carnitine helps the metabolism of fats for dogs that aren’t quite as active as they used to be. Who says old pups slow down? With Nulo FreeStyle they can get better with age. Key Benefits Grain-free senior formula that is free from chicken and egg proteins Glucosamine and chondroitin aid in proper hip and joint health Includes L-Carnitine to support an older dog''s metabolism Contains pure probiotic strains to aid in proper digestion Calcium and phosphorus help your dog maintain strong bones while wholesome vegetables and fruits support optimal immune health', 'https://www.petproducts.com/static/upload/products/nulo/-nulo-freestyle-grain-free-trout+sweet-potato-recipe-senior-dry-dog-food-24-lbs/811939020140.jpg'),
    (195, 'Nulo Freestyle Grain Free Beef, Peas & Carrot Recipe Dog Food, 13 oz (Case of 12)', 48, 'food', 43, 'Make your dog’s nutrition exciting again. Let them try this savory blend of beef & vegetables with rich proteins and healthy vitamins. Dogs will love the taste while giving them the fuel to keep up with you. Use as the primary diet for your favorite four-legged friend or as a ‘special’ topper for dry kibble recipes. Key Benefits A grain-free formula that contains beef as it''s first ingredient Contains pure probiotic strains to aid in proper digestion Calcium and phosphorus help your dog maintain strong bones while wholesome vegetables and fruits support optimal immune health Amino acids to support lean muscle mass and a healthy heart Made with added essential vitamins like D, B12 and vitamin A', 'https://www.petproducts.com/static/upload/products/nulo/-nulo-freestyle-grain-free-beef-peas+carrot-recipe-dog-food-13-oz-case-of-12/811939020218.jpeg'),
    (196, 'Nulo Freestyle Grain Free Lamb & Lentils Recipe Dog Food, 13 oz (Case of 12)', 43, 'food', 43, 'Make nutrition fun again for your favorite pup. Mix it up with this grain-free chicken, carrots & peas recipe giving them a healthy combination of protein and vegetables in every serving. Use as the primary diet for your favorite four-legged friend or as a ‘special’ topper for dry kibble recipes. Key Benefits A grain-free formula that contains chicken as it''s first ingredient Contains pure probiotic strains to aid in proper digestion Calcium and phosphorus help your dog maintain strong bones while wholesome vegetables and fruits support optimal immune health Amino acids to support lean muscle mass and a healthy heart Made with added essential vitamins like D, B12 and vitamin A', 'https://www.petproducts.com/static/upload/products/nulo/-nulo-freestyle-grain-free-lamb+lentils-recipe-dog-food-13-oz-case-of-12/811939020225.jpg'),
    (197, 'Nulo Freestyle Grain-Free Salmon & Chickpeas Recipe Wet Dog Food, 13 oz (Case Of 12)', 14, 'food', 43, 'Nulo Dog Grain Free Salmon 13oz Can An excellent complement to any dog’s diet, our salmon & chickpeas recipe delivers a savory mix of salmon and turkey meat that dogs find irresistible. Use as the primary diet for your favorite four-legged friend or as a ‘special’ topper for our dry kibble recipes.', 'https://www.petproducts.com/static/upload/products/nulo/-nulo-freestyle-grain-free-salmon+chickpeas-recipe-wet-dog-food-13-oz-case-of-12/811939020232.jpg'),
    (198, 'Nulo FreeStyle Grain-Free Turkey & Sweet Potato Recipe Puppy Dry Food, 4.5 lbs', 38, 'food', 22, 'Nulo FreeStyle gives every puppy the healthy start they deserve. With 80% of proteins coming from real meat, you can be sure your pup is getting all the amino acids they need to fuel growing muscles. DHA fatty acids also support brain & eye development and Nulo''s guaranteed calcium levels promote strong teeth & bones. And with the flavor of our grain-free salmon and peas recipe, your puppy will come running for every bowl. Key Benefits A grain-free puppy formula free of any chicken or egg proteins Made with low glycemic index ingredients and added calcium and phosphorous for strong bones Contains 80% animal-based proteins and DHA that growing puppies need Wholesome vegetables and fruits to support optimal immune health Omega-3 and omega-6 fatty acids will give your pup brilliant skin and coat', 'https://www.petproducts.com/static/upload/products/nulo-freestyle-grain-free-turkey--sweet-potato-recipe-puppy-dry-food-45-lbs/Nulo%20FreeStyle%20Grain-Free%20Turkey%20&%20Sweet%20Potato%20Recipe%20Puppy%20Dry%20Food.jpg'),
    (199, 'Grandma Lucy''s Macanna Freeze Dried Grain Free Dog Food - Beef Recipe, Trial Size (case of 6)', 49, 'food', 5, 'Grandma Lucy’s believes that healthy food should not only be good for you, but taste good as well. We have taken many of Mother Nature’s delicious superfoods and blended them in a way to bring your dog a diet that is highly nutritious, filled with whole ingredients they will love. Superfoods such as hemp hearts, coconut, kale, and turmeric are some of the easiest and best ways of increasing your pet’s nutrient intake through food. Every single ingredient in MACANNA was chosen with a specific benefit in mind. Hemp Hearts are rich in Omegas 6 and 3 to help give your pets a shiny coat. Coconut is a nutritional powerhouse filled with heart healthy antioxidants, vitamins and minerals. Kale is one of the most nutrient dense foods on the planet that is also high in antioxidants, fiber, and folic acid to help promote a healthy heart, skin, bones, and eyes. Turmeric is an ancient spice that has been known for many health benefits such as its anti-inflammatory properties and its help in maintaining a healthy digestive system, skin, and joints. All of these superfoods together make a food filled with benefits so your dog can eat their way to health.', 'https://www.petproducts.com/static/upload/products/grandma-lucys/-grandma-lucys-macanna-freeze-dried-grain-free-dog-food-beef-recipe-trial-size-case-of-6/884308366231-front.png'),
    (200, 'Grandma Lucy''s Pureformance Freeze Dried Grain Free Dog Food - Fish Recipe with Chickpeas Trial 1.5oz (Case of 6)', 33, 'food', 5, 'Grandma Lucy''s Pureformance™ Fish Recipe is formulated to meet the nutritional levels established by the AAFCO Dog Food Nutrient Profiles for All Life Stages.', 'https://www.petproducts.com/static/upload/products/grandma-lucys/-grandma-lucys-pureformance-freeze-dried-grain-free-dog-food-fish-recipe-with-chickpeas-trial-15oz-case-of-6/884308368198-front.png'),
    (201, 'Grandma Lucy''s Artisan Freeze Dried Grain Free Dog Food - Chicken Recipe, 3 lbs (1.4kg)', 31, 'food', 27, 'Easy to prepare freeze-dried recipe: just add warm water, mix and serve. Ready in just 3 minutes! With premium ingredients like USDA chicken that is hormone and antibiotic free, potato, flaxseed, apples, blueberries, and cranberries A great option for pets prone to food sensitivities and digestive upset. Rich in natural omega fatty acids that help maintain a healthy skin and coat and healthy joints All natural, with no grains, by-products, preservatives or GMOs Provides complete and balanced nutrition for all life stages', 'https://www.petproducts.com/static/upload/products/grandma-lucys/-grandma-lucys-artisan-freeze-dried-grain-free-dog-food-chicken-recipe-3-lbs-14kg/Artisan_chicken_3lb.png'),
    (202, 'Grandma Lucy''s Artisan Freeze Dried Grain Free Dog Food - Pork Recipe, 3 lbs (1.4kg)', 23, 'food', 27, 'Tasty pieces of USDA pork, an energy packed food. High in many vitamins and minerals, pork is good for the eyes, skin, nervous system and bones. Preparation is easy: simply add warm water, stir, and serve after 3-5 minutes. Ideally suited for pets with food allergies or sensitivities. Formulated to meet the nutritional levels established by the AAFCO Dog Food Nutrient Profiles for All Life Stages. Made in USA.', 'https://www.petproducts.com/static/upload/products/grandma-lucys/-grandma-lucys-artisan-freeze-dried-grain-free-dog-food-pork-recipe-3-lbs-14kg/Artisan_pork_3lb.png'),
    (203, 'Grandma Lucy''s Artisan Freeze Dried Grain Free Dog Food - Venison Recipe, 10 lbs (4.54kg)', 27, 'food', 105, 'Venison is one of the most nutritious meats. Naturally low in fat and calories, it is also an excellent source of protein, iron and many B Vitamins. We use fresh vegetables in our recipe to deliver Beta Carotene (Vitamin A), Potassium, Niacin and B Vitamins right from the source.', 'https://www.petproducts.com/static/upload/products/grandma-lucys/-grandma-lucys-artisan-freeze-dried-grain-free-dog-food-venison-recipe-10-lbs-454kg/Artisan_venison_10lb.png'),
    (204, 'Grandma Lucy''s Artisan Freeze Dried Grain Free Pre-Mix, 8 lbs', 46, 'food', 56, 'If you are already cooking for your dog, Grandma Lucy''s Artisan Grain-Free Freeze Dried Pre-Mix is the perfect addition to your dog food recipes. Whether your dog requires a more unique protein or just a variety of meats, the Artesian Pre-Mix will save you the time of preparing the fruits and vegetables for their diet. Simply measure out your dog''s desired amount of Artesian Pre-Mix, mix with an equal amount of water, add in your dog''s favorite protein and serve – It''s that simple.', 'https://www.petproducts.com/static/upload/products/grandma-lucys/-grandma-lucys-artisan-freeze-dried-grain-free-pre-mix-8-lbs/Artisan_premix_8lb.png'),
