    (207, 'Grandma Lucy''s Pureformance Freeze Dried Grain Free Dog Food - Rabbit Recipe with Chickpeas, 3 lbs (1.4kg)', 24, 'food', 44, 'Grandma Lucy''s Pureformance™ Rabbit Recipe is formulated to meet the nutritional levels established by the AAFCO Dog Food Nutrient Profiles for All Life Stages.', 'https://www.petproducts.com/static/upload/products/grandma-lucys/-grandma-lucys-pureformance-freeze-dried-grain-free-dog-food-rabbit-recipe-with-chickpeas-3-lbs-14kg/Pureformance_rabbit_3lb.png'),
    (208, 'Grandma Lucy''s Simple Replacement Meal, Chicken & Rice Formula, 7 oz (198g)', 16, 'food', 13, 'Now a simple remedy for your dog or cat when they are suffering from an upset stomach – Grandma Lucy’s Simple Remedy! To give your pet an easy to digest meal until they are feeling back to normal, just add hot/boiling water to the chicken and rice mixture and feed your pet small amounts until their ailment disappears. As recommended by veterinarians, Grandma Lucy’s Simple Remedy is human-grade, white, boneless, skinless chicken breasts and plain white rice – nothing else. Finally a convenient way to make your pet’s stomach feel back to normal, just like the doctor ordered.', 'https://www.petproducts.com/static/upload/products/grandma-lucys/-grandma-lucys-simple-replacement-meal-chicken+rice-formula-7-oz-198g/Simple_Remedy.png'),
    (209, 'Grandma Lucy''s Moxie Freeze Dried Dog Food, Chicken Recipe, 8 oz (227g)', 37, 'food', 19, 'NATURAL Grandma Lucy''s finds the highest quality natural ingredients from around the globe to ensure pets'' health. FREEZE-DRIED Our gentle freeze-drying process removes 92% of the water contained in our ingredients, leaving a food that is lightweight, compact, shelf-stable and preservative-free. MINIMALLY PROCESSED All Grandma Lucy''s products are minimally processed, retaining the cell structure of our ingredients without compromising vitamins, nutrients, color or aroma. NO GRAIN Removing grains from a dogs diet promotes healthy weight, higher energy levels and helps fight food intolerance. NO PRESERVATIVES As part of our commitment to creating wholesome natural products, there are no added preservatives in our pet foods or treats.', 'https://www.petproducts.com/static/upload/products/grandma-lucys/-grandma-lucys-moxie-freeze-dried-dog-food-chicken-recipe-8-oz-227g/884308710010-front.png'),
    (210, 'Grandma Lucy''s Artisan Freeze Dried Grain Free Dog Food - Chicken Recipe, 1 lb (0.45kg)', 30, 'food', 10, 'Easy to prepare freeze-dried recipe: just add warm water, mix and serve. Ready in just 3 minutes! With premium ingredients like USDA chicken that is hormone and antibiotic free, potato, flaxseed, apples, blueberries, and cranberries A great option for pets prone to food sensitivities and digestive upset. Rich in natural omega fatty acids that help maintain a healthy skin and coat and healthy joints All natural, with no grains, by-products, preservatives or GMOs Provides complete and balanced nutrition for all life stages', 'https://www.petproducts.com/static/upload/products/grandma-lucys/-grandma-lucys-artisan-freeze-dried-grain-free-dog-food-chicken-recipe-1-lb-045kg/1lb_artisan_chicken.png'),
    (211, 'Grandma Lucy''s Artisan Freeze Dried Grain Free Dog Food - Pork Recipe, 1 lb (0.45kg)', 23, 'food', 10, 'Pork is an energy packed food. High in many vitamins and minerals, pork is good for the eyes, skin, nervous system and bones. We use fresh vegetables in our recipe to deliver Beta Carotene (Vitamin A), Potassium, Niacin and B Vitamins right from the source.', 'https://www.petproducts.com/static/upload/products/grandma-lucys/-grandma-lucys-artisan-freeze-dried-grain-free-dog-food-pork-recipe-1-lb-045kg/1lb_artisan_pork.png'),
