    (214, 'Blue Buffalo Life Protection Formula Adult Dog Food Chicken and Brown Rice Recipe, 15 lb', 41, 'food', 78, 'Formulated for the health and well-being of dogs, BLUE Life Protection Formula Chicken & Brown Rice Recipe is made with the finest natural ingredients enhanced with vitamins, minerals and other nutrients. Starting with delicious, high-quality deboned chicken, it features antioxidant-rich fruits and veggies and wholesome whole grains.', 'https://www.petproducts.com/static/upload/products/assorted/blue-buffalo--life-protection-formula-adult-dog-food-chicken-and-brown-rice-recipe-15-lb/xe2rbv9.jpg'),
    (215, 'Blue Buffalo Life Protection Formula Large Breed Adult Dog Food Chicken and Brown Rice Recipe, 15 lb', 30, 'food', 84, 'Formulated for the health and well-being of large breed dogs, BLUE Life Protection Formula is made with the finest natural ingredients enhanced with vitamins, minerals and other nutrients. Starting with delicious, high-quality chicken, it features antioxidant-rich fruits and veggies, wholesome whole grains, plus glucosamine and chondroitin to support the mobility needs of larger dogs.', 'https://www.petproducts.com/static/upload/products/assorted/blue-buffalo--life-protection-formula-large-breed-adult-dog-food-chicken-and-brown-rice-recipe-15-lb/db6qaq7.jpg'),
    (216, 'Blue Buffalo Life Protection Formula Small Breed Adult Dog Food Chicken and Brown Rice Recipe, 15 lb', 30, 'food', 84, 'Formulated for the health and well-being of small breed dogs, BLUE Life Protection Formula is made with the finest natural ingredients enhanced with vitamins, minerals and other nutrients. Starting with delicious, high-quality chicken, it features antioxidant-rich fruits and veggies and wholesome whole grains. Formulated with a precise blend of proteins and carbohydrates, this recipe helps support the higher energy needs of smaller dogs.', 'https://www.petproducts.com/static/upload/products/assorted/blue-buffalo--life-protection-formula-small-breed-adult-dog-food-chicken-and-brown-rice-recipe-15-lb/n8upibe.jpeg'),
    (217, 'Castor & Pollux Organix Grain Free Organic Chicken & Sweet Potato Recipe, 4 lb', 42, 'food', 26, 'Castor & Pollux Organix Organic Grain Free Dry Dog Food Chicken & Sweet Potato Recipe provides 100% complete and balanced nutrition for all life stages of dogs. With organic chicken as the first ingredient and high quality chicken meal, made from natural, USDA-inspected chickens, Organix has a protein-rich highly digestible and grain-free foundation.', 'https://www.petproducts.com/static/upload/products/assorted/castor+pollux--organix-grain-free-organic-chicken+sweet-potato-recipe-4-lb/mlbeysn.jpg'),
    (218, 'Castor & Pollux Organix Grain Free Organic Chicken & Sweet Potato Recipe, 10 lb', 28, 'food', 61, 'Balanced, grain-free nutrition for happy, healthy dogs. The #1 ingredient in our ORGANIX Grain Free Organic Chicken & Sweet Potato Recipe is organic chicken. Our organic ingredients are produced without chemical pesticides, synthetic fertilizers, artificial preservatives, added growth hormones or antibiotics. This recipe contains no corn, wheat, or soy. Organic is always non-GMO. Grain Free USDA Organic With a blend of superfoods - organic flaxseed, organic blueberries, and organic coconut oil. Omega-6 fatty acids for healthy skin and coat Cooked with love in an organically certified USA kitchen', 'https://www.petproducts.com/static/upload/products/assorted/castor+pollux--organix-grain-free-organic-chicken+sweet-potato-recipe-10-lb/qnue5s4.jpg'),
    (219, 'Iams Proactive Health Adult High Protein Lamb & Rice Dry Dog Food, 38.5 lb', 36, 'food', 60, 'Your dog is one-of-a-kind… that''s why IAMS makes a dry dog food that''s just as unique as they are. IAMS Adult Dry Dog Food with Lamb and Rice gives them the nutritional support they need in a tasty dog kibble they''ll love. With real, premium lamb as the first ingredient, this adult dog food supports healthy digestion with a wholesome blend of fibers and prebiotics, while omega-6 fatty acids promote a healthy skin and coat. Plus, this lamb dog food builds strong muscles with quality-sourced protein. When you feed your dog IAMS dry food, you can feel good knowing they''re getting the nutrition they need to bring out their unique best.', 'https://www.petproducts.com/static/upload/products/assorted/iams--proactive-health-adult-high-protein-lamb+rice-dry-dog-food-385-lb/nu0zrl2.jpg'),
    (220, 'Iams Proactive Health Adult Lamb Meal And Rice Formula Dry Dog Food, 30 lb', 50, 'food', 47, 'Iams Tailored Nutrition Not all dogs are the same, so why feed them the same generic food? IAMS understands that every dog is different, and we respect those differences. That''s why IAMS provides a wide range of premium recipes tailored to meet the unique needs of different dogs, so that dogs of all shapes and sizes can be at their best, today and every day. Look for the IAMS difference. Healthy Skin and Coat: Omega 6 fatty acid for healthy skin and coat. Strong Muscles: Supports strong, firm muscles with protein sourced from lamb and egg. Healthy Digestion: Tailored blend of wholesome fiber & natural prebiotics for healthy digestion. Healthy Metabolism: Formulated with L-Carnitine to help maintain healthy metabolism. Strong Immune System: Enriched with antioxidants to help maintain a strong immune system. Healthy Teeth: Crunchy kibbles scrub your dog''s teeth with every bite, to help reduce plaque buildup that can lead to bad breath.', 'https://www.petproducts.com/static/upload/products/assorted/iams--proactive-health-adult-lamb-meal-and-rice-formula-dry-dog-food-30-lb/ihubgun.jpg'),
    (221, 'Iams Proactive Health Adult Small And Toy Breed Dry Dog Food, 7 lb', 10, 'food', 18, '#1 Ingredient is Real Chicken. Promotes healthy skin & coat with omega fatty acids. Supports strong immune system with antioxidants. Promotes strong muscles with quality protein. IAMS Tailored Nutrition Not all dogs are the same, so why feed them the same generic food? Iams understands that every dog is different, and we respect those differences. That''s why Iams provides a wide range of premium recipes tailored to meet the unique needs of difference dogs, so that dogs of all shapes and sizes can be at their best, today and every day. Look for the Iams difference. Healthy Skin and Coat Omega 6 fatty acid for healthy skin and coat. Strong Muscles Supports strong, firm muscles with protein sourced from chicken and egg. Healthy Digestion Tailored blend of wholesome fiber & natural prebiotics for healthy digestion. Healthy Metabolism Formulated with L-Carnitine to help maintain health metabolism. Strong Bones Fortified with essential minerals to help maintain strong bones. Strong Immune System Antioxidant blend for a healthy immune system for smaller dogs. Made with Real Wholesome Ingredients Farm-Raised Chicken helps support strong, healthy muscles. Wholesome Grains provide essential nutrients & carbohydrates for healthy energy. Garnishes of Fruit including real apples & blueberries. Garnishes of Veggies including real carrots and peas. Beet Pulp with wholesome fiber & natural prebiotics for healthy digestion.', 'https://www.petproducts.com/static/upload/products/assorted/iams--proactive-health-adult-small-and-toy-breed-dry-dog-food-7-lb/ri0yq1o.jpg'),
    (222, 'Iams Proactive Health Small & Toy Breed Adult For Small Dogs With Real Chicken Dry Dog Food, 15 lb', 30, 'food', 30, 'Your small breed adult dog is one-of-a-kind… that''s why IAMS makes a toy breed dog food that''s just as unique as they are. IAMS Adult Small Breed Dry Dog Food with Real Chicken was created to meet the specific wellness and nutritional needs of your lovable small dog. With real, farm-raised chicken as the first ingredient, this adult dog food maintains your toy breed''s skin and coat health with omega-6 fatty acids. Plus, the tasty dog kibble helps build strong muscles, and antioxidants support their tiny immune systems. When you feed your small breed dog IAMS dry food, you can feel good knowing they''re getting the nutrition they need to bring out their unique best.', 'https://www.petproducts.com/static/upload/products/assorted/iams--proactive-health-small+toy-breed-adult-for-small-dogs-with-real-chicken-dry-dog-food-15-lb/m4wfg62.jpg'),
    (223, 'Inaba Dog Twin Cups Chicken With Vegetables Recipe Dog Food Topper, 2.46 oz', 33, 'food', 2, 'Delight your furry friends with Twins: they''ll will love the succulent gelee with real meat. Why We Love It Delighting pets all over the world Convenient Auto-Ship Made with all natural ingredients.', 'https://www.petproducts.com/static/upload/products/assorted/inaba--dog-twin-cups-chicken-with-vegetables-recipe-dog-food-topper-246-oz/6ggz3a4.jpg'),
    (224, 'Instinct Grain Free Lid Lamb Canned Dog Food, 13.2 oz, Case of 6', 36, 'food', 33, 'Fresh, real lamb is an excellent alternative to chicken and is easier on digestive systems. That''s why Nature''s Variety Instinct Grain-Free LID Lamb Canned Dog Food is made of one protein source, fresh, real lamb. With additional easily digestible fruits and vegetables, Instinct Lamb Canned Dog Food is easy on the stomach, and even easier on the taste buds. Nature''s Variety understands that sometimes the ingredients that are not included in a recipe are just as important as the ingredients that are, so Instinct Grain-Free LID Lamb Canned Dog Food is free of grains, gluten, chicken, beef, eggs, and dairy. Your dog deserves a food That''s nutritious, delicious, and just right for their sensitive needs. Why We Love It Made from one animal protein source Free of common ingredients such as chicken, beef, and dairy Grain-free and gluten-free recipe', 'https://www.petproducts.com/static/upload/products/assorted/instinct--grain-free-lid-lamb-canned-dog-food-132-oz-case-of-6/lb6dw2t.jpg'),
    (225, 'Instinct Grain-Free Chicken Formula Canned Dog Food, 13.2 oz, Case of 6', 50, 'food', 23, 'All dogs deserve a healthy, tasty, high protein diet. Luckily, there''s Instinct Grain-Free Chicken Formula Canned Dog Food. Every bite is packed with real chicken, wholesome fruits, vegetables, and zero grains or fillers. Essentials like omega fatty acids are added for a healthy skin and coat, and heart health. Plus, with 95% real chicken, turkey, and liver, dogs can''t get enough of the flavor! Why We Love It Grain-free and gluten-free Made with 95% real chicken, turkey, and liver Added omega fatty acids for a healthy skin and coat', 'https://www.petproducts.com/static/upload/products/assorted/instinct--grain-free-chicken-formula-canned-dog-food-132-oz-case-of-6/3n1y2em.jpg'),
    (226, 'Instinct Grain-Free Beef Formula Canned Dog Food, 13.2 oz, Case of 6', 10, 'food', 24, 'With high quality, real beef in every bite, and supplemented with fruits and vegetables, Instinct Grain-Free Beef Formula Canned Dog Food is sure to be a hit with your furry friend. Essential vitamins and minerals like omega fatty acids keep your dog''s coat glossy and their skin healthy, while 95% real beef and liver adds muscle building protein and unmatched taste. With no fillers like grain or gluten, you''ll know your dog is getting only the best nutrition and nothing they shouldn''t. Why We Love It 0% Grains and Gluten95% real beef and liver Balanced for all life stages and breeds', 'https://www.petproducts.com/static/upload/products/assorted/instinct--grain-free-beef-formula-canned-dog-food-132-oz-case-of-6/i2ph0xf.jpg'),
    (227, 'Instinct Grain-Free Rabbit Formula Canned Dog Food, 13.2 oz, Case of 6', 37, 'food', 33, 'With real rabbit and wholesome fruits and vegetables, Instinct Grain-Free Rabbit Formula Canned Dog Food makes a grain-free, instinctual diet easy. Essential vitamins and minerals like omega fatty acids keep your dog''s coat and skin healthy and shiny, while 95% real rabbit and pork liver adds delicious flavor they can''t turn their noses at. Completely free of fillers like grains and gluten, you''ll feel good about the nutritional value and even better about what''s not in it. Giving your dog the support they need to live a happy life just got easier with Instinct Grain-Free Rabbit Formula Canned Dog Food, plus it''s specially balanced for all breeds and life stages so your pup can enjoy their favorite food for life. Why We Love It Free of fillers like grains and gluten95% real rabbit and pork liver Formulated for all life stages and breeds', 'https://www.petproducts.com/static/upload/products/assorted/instinct--grain-free-rabbit-formula-canned-dog-food-132-oz-case-of-6/qqk1r4d.jpg'),
    (228, 'Instinct Grain Free Lid Rabbit Canned Dog Food, 13.2 oz, Case of 6', 50, 'food', 36, 'Sensitive digestive systems can be difficult to manage. Nature''s Variety is here to help, with Instinct Grain-Free LID Rabbit Canned Dog Food. Made with one single animal protein, high quality rabbit, and highly digestible, simple ingredients, feel good knowing your dog is eating a simple, digestible diet. Free of grains and gluten for extra digestibility, and balanced for all life stages, Instinct LID features only recognizable ingredients in grain-free formulas. Why We Love It Made with real rabbit Limited ingredient formula for dogs with sensitive needs Grain-free and gluten-free recipe', 'https://www.petproducts.com/static/upload/products/assorted/instinct--grain-free-lid-rabbit-canned-dog-food-132-oz-case-of-6/l40nmmu.jpg'),
