    (256, 'Instinct Raw Boost Healthy Weight Adult Grain Free Recipe With Real Chicken Natural Dry Dog Food, 20 lb', 25, 'food', 80, 'High animal-protein, grain-free, boosted nutrition with bites of freeze-dried raw meat, instinct raw boost grain-free recipe with real chicken for healthy weight is a better way to feed kibble. Unlock your dog''s potential to thrive and put more of the pure, real nutrition of raw into every bowl. Boosted nutrition for healthy weight - grain-free, high protein kibble + freeze-dried raw; 25% less fat, 15% fewer calories than instinct raw boost. Cage-free chicken is the first ingredient - packed with animal protein for strong, lean muscles. Freeze-dried raw - all natural, protein packed, minimally processed bites of real chicken. L-carnitine to help burn fat to support healthy metabolism + the ideal fiber level to help your dog feel fuller, longer. Made without - grain, potato, corn, wheat, soy, by-product meal, artificial colors or preservatives. Made in the USA with the finest ingredients from around the world. Why We Love It Reduced calories to maintain a healthy weight Added L-Carnitine to help burn fat-free of Grains and Gluten', 'https://www.petproducts.com/static/upload/products/assorted/instinct--raw-boost-healthy-weight-adult-grain-free-recipe-with-real-chicken-natural-dry-dog-food-20-lb/0v9foni.jpg'),
    (257, 'Limited Ingredient Diet Adult Grain Free Recipe With Real Lamb Natural Dry Dog Food, 20 lb', 12, 'food', 80, 'When your dog has food sensitivities, knowing exactly what''s in their food is important. That''s why our ingredient lists are purposefully short, made with one animal protein and one vegetable, versus the mix of each you''ll find in most other dog foods. Guided by the purity and simplicity of raw, instinct limited ingredient diet grain-free recipe with real lamb is simple and essential nutrition your dog needs to thrive. Purposefully simple ingredient list for pets with food sensitivities - one animal protein and one vegetable . Made with grass-fed lamb - a nutrient rich, easily digestible protein that provides all the essential amino acids. Made without - grain, dairy, eggs, chicken, beef, fish, sweet potato, potato, chickpeas, corn, wheat, soy, artificial colors or preservatives. Guaranteed levels of natural omegas and antioxidants for healthy skin & coat, and immune health. The only limited ingredient diet kibble with the pure, real nutrition of raw on every piece. Made in the USA with the finest ingredients from around the world. Why We Love It Grain-Free and gluten free ingredients for prime nutrition Made with one animal protein source for sensitive digestive systems Balanced for all life stages and all breeds', 'https://www.petproducts.com/static/upload/products/assorted/instinct-limited-ingredient-diet-adult-grain-free-recipe-with-real-lamb-natural-dry-dog-food-20-lb/tgkgaem.jpg'),
    (258, 'Instinct Healthy Cravings Grain-Free Tender Beef Recipe Meal Topper Pouches For Dogs, 3 oz, Case of 24', 14, 'food', 48, 'Enhance your dog''s favorite meal with Instinct Healthy Cravings Grain-Free Tender Beef Recipe Meal Topper Pouches for Dogs. Made with genuine beef in a delicious gravy sauce with zero artificial colors, preservatives, or flavors. Free of fillers like corn, soy, and wheat, Instinct Healthy Cravings Grain-Free Beef Toppers are perfect for adding that extra boost of protein and nutrition to your dog''s regular diet. Why We Love It Free of artificial flavors and preservatives Free of grains, corn, soy, and wheat Real, all natural beef', 'https://www.petproducts.com/static/upload/products/assorted/instinct--healthy-cravings-grain-free-tender-beef-recipe-meal-topper-pouches-for-dogs-3-oz-case-of-24/1au7n84.jpeg'),
