    (263, 'Merrick Grain Free 96% Real Duck Canned Dog Food, 12.7 oz, Case of 12', 10, 'food', 45, 'Merrick Grain Free 96% Real Duck Canned Dog Food starts with real, USDA-inspected deboned duck. Packed with all the vitamins and nutrients your dog needs, it''s 96% meat, meaning high protein, the most important ingredient in a dog''s diet. As with all of Merrick''s recipes, their ingredients are sourced fresh and locally in the United States. Great as a topper for your dog''s regular dry kibble or as a stand-alone meal, Merrick Grain Free 96% Real Duck Canned Dog Food is sure to be a hit!', 'https://www.petproducts.com/static/upload/products/assorted/merrick--grain-free-96-real-duck-canned-dog-food-127-oz-case-of-12/ay5wf9y.jpg'),
