    (270, 'Merrick Grain Free Puppy Plate Beef Recipe Canned Puppy Food, 12.7 oz, Case of 12', 23, 'food', 45, 'Merrick has long been known for its high quality, innovative and humanized canned dog food recipes. Each grain-free wet recipe is brought to life with real deboned meat, fish or poultry as the first ingredient plus a balance of quality fruits and vegetables, crafted one batch at a time for wholesome, balanced nutrition.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--grain-free-puppy-plate-beef-recipe-canned-puppy-food-127-oz-case-of-12/dxa76j0.jpg'),
    (271, 'Merrick Backcountry Raw Infused With Healthy Grains Puppy Recipe Dry Dog Food, 4 lb', 25, 'food', 28, 'Backcountry means back to nature. It''s an all-natural, ancestral diet packed with the protein dogs crave and loaded with the nutrients they need. It mixes freeze-dried raw-coated kibble with freeze-dried raw pieces of real meat, poultry or fish - all with a texture and taste so delicious your dog will go wild for it. Backcountry offers both healthy grain and grain free dog food recipes and is best for all life stages and all breed sizes. PROTEIN-PACKED KIBBLE + FREEZE-DRIED RAW-COATED KIBBLE + REAL WHOLE PIECES OF FREEZE-DRIED RAW MEAT Freeze dried raw meat, safely processed for a convenient and nutritious option for those pet parents interested in a raw-style diet.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--backcountry-raw-infused-with-healthy-grains-puppy-recipe-dry-dog-food-4-lb/u1otkmg.jpg'),
    (272, 'Merrick Lil'' Plates Small Breed Grain Free Real Salmon & Sweet Potato Dry Dog Food, 4 lb', 43, 'food', 26, 'Merrick Lil'' Plates Small Breed Grain-Free Real Salmon and Sweet Potato Dry Dog Food provides nutrition suited for your small breed pup with real salmon and ingredients sourced from local farmers. 55% of Merrick Lil'' Plates Small Breed Grain-Free Real Salmon and Sweet Potato Dry Dog Food is composed of fish and healthy fat ingredients that help build and maintain lean, healthy muscle tissue with high quality protein starting with deboned salmon. The remaining 45% is made up of fresh produce including easy to digest carbohydrates like potatoes and sweet potatoes which provide sustained energy without upsetting grain-sensitive systems. It also includes omega fatty acids to promote healthy skin and coat as well as glucosamine to support joint health!', 'https://www.petproducts.com/static/upload/products/assorted/merrick--lil-plates-small-breed-grain-free-real-salmon+sweet-potato-dry-dog-food-4-lb/21sfu13.jpg'),
    (273, 'Merrick Lil'' Plates Small Breed Grain Free Real Beef & Sweet Potato Dry Dog Food, 4 lb', 14, 'food', 26, 'Merrick Lil'' Plates Small Breed Grain-Free Real Beef and Sweet Potato Dry Dog Food provides nutrition suited for your small breed pup with real foods sourced from local farmers. 55% of Lil'' Plates is composed of meat and healthy fat ingredients that help build and maintain lean, healthy muscle tissue with high quality protein starting with deboned beef. The remaining 45% is made up of fresh produce including easy to digest carbohydrates like potatoes and sweet potatoes which provide sustained energy without upsetting grain-sensitive systems. Merrick Lil'' Plates also includes omega fatty acids to promote healthy skin and coat as well as glucosamine to support joint health.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--lil-plates-small-breed-grain-free-real-beef+sweet-potato-dry-dog-food-4-lb/dwn3ofr.png'),
    (274, 'Merrick Lil'' Plates Grain Free Senior Real Chicken And Sweet Potato Recipe Dry Dog Food, 4 lb', 48, 'food', 24, 'Small breed dogs have hit the big time, now accounting for 47 percent of today''s dog population. With growing interest in small breed dogs comes demand for high quality dog food that''s specially formulated to meet their particular dietary needs. Now, to cater to the big appetites of small senior pups, Merrick is introducing a Lil'' Plates Grain Free Senior Real Chicken & Sweet Potato Recipe. It features lower calories and less fat to help older Best Dogs Ever manage their weight and leading levels of glucosamine and chondroitin to foster healthy hips and joints and L-carnitine for healthy metabolism in aging dogs.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--lil-plates-grain-free-senior-real-chicken-and-sweet-potato-recipe-dry-dog-food-4-lb/ju2hssd.jpg'),
