    (279, 'Merrick Lil'' Plates Adult Small Breed Grain Free Dainty Duck Medley Canned Dog Food, 3.5 oz, Case of 12', 30, 'food', 27, 'Merrick Lil'' Plates Adult Small Breed Grain-Free Dainty Duck Medley Canned Dog Food packs a delicious punch in a smaller portioned meal that any pup is sure to love! Made with duck, potatoes, carrots, and peas, Merrick Lil'' Plates Adult Small Breed Grain-Free Dainty Duck Medley Canned Dog Food is full of vitamins and minerals dogs thrive on! Using only farm fresh, real ingredients and no artificial colors, flavors, or preservatives, Merrick Lil'' Plates Adult Small Breed Grain-Free Dainty Duck Medley Canned Dog Food is sure to a hit with your petite pooches!', 'https://www.petproducts.com/static/upload/products/assorted/merrick--lil-plates-adult-small-breed-grain-free-dainty-duck-medley-canned-dog-food-35-oz-case-of-12/ow4zuoc.jpg'),
    (280, 'Merrick Lil'' Plates Small Breed Grain Free Teeny Texas Steak Tips Dog Food Tray, 3.5 oz, Case of 12', 31, 'food', 27, 'Merrick Lil'' Plates Adult Small Breed Grain-Free Teeny Texas Steak Tips Canned Dog Food packs a delicious punch in a smaller portioned meal that any pup is sure to love! Starting with real deboned beef, this recipe is full of vitamins and minerals dogs thrive on. Using only farm, fresh ingredients and no artificial colors, flavors, or preservatives, Merrick Lil'' Plates is sure to a hit with your smaller furry family members. Why We Love It The perfect portion for your small breed pup! Grain-free and made with fresh meat and produce!', 'https://www.petproducts.com/static/upload/products/assorted/merrick--lil-plates-small-breed-grain-free-teeny-texas-steak-tips-dog-food-tray-35-oz-case-of-12/u3xkroa.jpg'),
    (281, 'Merrick Lil'' Plates Small Breed Grain Free Pint Size Puppy Plate In Gravy Dog Food Tray, 3.5 oz, Case of 12', 33, 'food', 27, 'Merrick Lil'' Plates Small Breed Grain-Free Pint Size Puppy Plate in Gravy Dog Food Tray packs a delicious punch in a smaller portioned meal that any puppy is sure to love! Made with chicken, turkey, potatoes, and fresh produce, Merrick Lil'' Plates Small Breed Grain-Free Pint Size Puppy Plate in Gravy Dog Food Tray is full of vitamins and minerals growing puppies thrive on! Using only farm, fresh, real ingredients and no artificial colors, flavors, or preservatives, it''s sure to be a hit with your new pint-size furry family member! Why We Love It Grain-free, complete and balanced meal for your growing puppy No added artificial flavors, colors, or preservatives', 'https://www.petproducts.com/static/upload/products/assorted/merrick--lil-plates-small-breed-grain-free-pint-size-puppy-plate-in-gravy-dog-food-tray-35-oz-case-of-12/6ktz6g3.jpg'),
    (282, 'Merrick Lil'' Plates Grain Free Surfin & Turfin Supper In Gravy Dog Food Tray, 3.5 oz, Case of 12', 28, 'food', 27, 'Small breed dogs have hit the big time, now accounting for 47 percent of today''s dog population. With growing interest in small breed dogs comes demand for high quality dog food that''s specially formulated to meet their particular dietary needs. Now, to cater to the big appetites of small pups, Merrick is introducing a full line of grain-free dry and wet recipes for small breed dogs - Merrick Lil'' Plates. The lineup delivers big on the high quality nutrition and tasty mealtime experience Merrick is known for, in options that are easily digestible, convenient and right-sized portions for small breed dogs.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--lil-plates-grain-free-surfin+turfin-supper-in-gravy-dog-food-tray-35-oz-case-of-12/2vm7vgz.jpg'),
    (283, 'Merrick Grain Free Chunky Pappy''s Pot Roast Dinner Canned Dog Food, 12.7 oz, Case of 12', 37, 'food', 49, 'Give your dog the taste of a pot roast dinner with each serving of Merrick Chunky Grain Free Wet Dog Food Pappy''s Pot Roast Dinner Recipe. The first ingredient in this delectable beef dog food is always real, wholesome USDA-inspected deboned beef. Pop open a can of this adult dog food and fill your dog''s bowl with the big chunks of beef and hand-stuffed red jacket new potatoes and carrots in a mouth-watering gravy. This grain free canned dog food recipe makes any mealtime special, and the addition of a savory gravy gives your dog something to look forward to. All Merrick canned recipes can be served as a topper for dry kibble or a standalone meal. Like all Merrick recipes, this moist and meaty dog food formula was crafted in our Hereford, Texas kitchen and cooked in the USA.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--grain-free-chunky-pappys-pot-roast-dinner-canned-dog-food-127-oz-case-of-12/5jtcew1.jpg'),
    (284, 'Merrick Grain Free Chunky Colossal Chicken Dinner Canned Dog Food, 12.7 oz, Case of 12', 38, 'food', 49, 'Give your dog the taste of a chicken dinner with each serving of Merrick Chunky Grain Free Wet Dog Food Colossal Chicken Dinner. The first ingredient in this delectable chicken dog food is always real, wholesome USDA-inspected deboned chicken. Pop open a can of this adult dog food and fill your dog''s bowl with the big chunks of chicken with hand-stuffed peas and carrots, all in a mouth-watering gravy. This grain free canned dog food recipe makes any mealtime special, and the addition of a savory gravy gives your dog something to look forward to. All Merrick canned recipes can be served as a topper for dry kibble or a standalone meal. Like all Merrick recipes, this moist and meaty dog food formula was crafted in our Hereford, Texas kitchen and cooked in the USA.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--grain-free-chunky-colossal-chicken-dinner-canned-dog-food-127-oz-case-of-12/rw0iv8m.jpg'),
    (285, 'Merrick Grain Free Chunky Carvers Delight Dinner Canned Dog Food, 12.7 oz, Case of 12', 12, 'food', 49, 'Give your dog the taste of a savory chicken and turkey dinner with each serving of Merrick Chunky Grain Free Wet Dog Food Carvers Delight Dinner. The first ingredient in this delectable, chicken and turkey dog food is always real, wholesome USDA-inspected deboned chicken. Pop open a can of this adult dog food and fill your dog''s bowl with the big chunks of chicken and turkey, along with hand-stuffed Yukon gold potatoes and carrots. This grain free canned dog food recipe makes any mealtime special, and the addition of a savory gravy gives your dog something to look forward to. All Merrick canned recipes can be served as a topper for dry kibble or a standalone meal. Like all Merrick recipes, this moist and meaty dog food formula was crafted in our Hereford, Texas kitchen and cooked in the USA.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--grain-free-chunky-carvers-delight-dinner-canned-dog-food-127-oz-case-of-12/d5gh13q.jpg'),
    (286, 'Merrick Grain Free Big Texas Steak Tips Dinner Canned Dog Food, 12.7 oz, Case of 12', 38, 'food', 49, 'Give your dog the taste of a steak dinner with each serving of Merrick Grain Free Wet Dog Food Chunky Big Texas Steak Tips Dinner. The first ingredient in this homestyle beef dog food is always real, wholesome USDA-inspected deboned beef. Pop open a can of this adult dog food and fill your dog''s bowl with the big chunks of beef in a mouth-watering gravy that dogs love. This grain free canned dog food recipe makes any mealtime special, and the addition of a savory gravy gives your dog something to look forward to. All Merrick canned recipes can be served as a topper for dry kibble or a standalone meal. Like all Merrick recipes, this moist and meaty dog food formula was crafted in our Hereford, Texas kitchen and cooked in the USA.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--grain-free-big-texas-steak-tips-dinner-canned-dog-food-127-oz-case-of-12/dhdwzcz.jpg'),
    (287, 'Merrick Grain Free Slow Cooked Bbq Texas Style Beef Recipe Canned Dog Food, 12.7 oz, Case of 12', 40, 'food', 49, 'Merrick has become known for crafting drool worthy wet dog food recipes. Try Merrick''s paw-licking BBQ wet dog food recipes for four-legged family members. Each complete and balanced recipe is inspired by a region or city that has become famous for a signature BBQ flavor.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--grain-free-slow-cooked-bbq-texas-style-beef-recipe-canned-dog-food-127-oz-case-of-12/1qzxvgs.jpg'),
    (288, 'Merrick Grain Free Beef Bone Broth Wet Dog Food Topper, 7 oz', 42, 'food', 7, 'Merrick Bone Broths offer nourishing dog food flavor boost that can be served to your dog in the way your pup prefers. Pour Merrick Bone Broths on top of dry dog food for a nourishing human grade flavor boost. Merrick Bone Broths can also be served as a savory dog treat. Mix Merrick Bone Broths instead of water with your dog''s freeze dried raw dog food. -NOURISHING DOG FOOD FLAVOR BOOST: Add this high quality, human grade bone broth on top of dry dog food as a dog treat or mixed with freeze dried raw bits in place of water. - Savory dog treat accented with superfoods like sweet potato and blueberries. Dog food meal compliment enhanced with unique spices including cinnamon, turmeric, and ginger. Grain free wet dog treat Natural source of ;minerals + joint-supporting compounds', 'https://www.petproducts.com/static/upload/products/assorted/merrick--grain-free-beef-bone-broth-wet-dog-food-topper-7-oz/9x07xyv.jpg'),
    (289, 'Merrick Classic Puppy Recipe Dry Dog Food, 4 lb', 29, 'food', 24, 'Best-in-class nutrition and big-time taste? Merrick Classic Healthy Grains dry dog food treats your dog to both and more, in easily digestible recipes that balance protein, fruits, vegetables and a healthy blend of whole grains - including ancient grains to support optimal digestion - and supply high levels of fiber, Omega-3 and 6 fatty acids, glucosamine and chondroitin. Merrick Classic Healthy Grains is best for puppies and adult dogs. FULL OF FIBER AND WHOLE GRAINS. Crafted with a blend of grains including brown rice, barley and quinoa.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--classic-puppy-recipe-dry-dog-food-4-lb/fxfniql.jpg'),
    (290, 'Merrick Classic Small Breed Recipe Dry Dog Food, 4 lb', 15, 'food', 24, 'Merrick Classic Small Breed Recipe Dry Dog Food provides natural nutrition from a wholesome balance of protein, whole grains, fruits, and vegetables all in a smaller kibble size perfect for the pint sized pals in your life! Merrick Classic Small Breed Recipe Dry Dog Food starts with real, farm fresh deboned chicken for high quality protein. Fresh produce and a healthy blend of whole grains including oatmeal and ancient grains like quinoa, while high levels of Omega 6 and Omega 3 fatty acids aid in a healthy skin and coat, accompanied with glucosamine and chondroitin to support healthy joints and hips.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--classic-small-breed-recipe-dry-dog-food-4-lb/8ylxj6c.jpg'),
    (291, 'Merrick Classic Chicken & Brown Rice Recipe With Ancient Grains Dry Dog Food, 4 lb', 12, 'food', 24, 'NOTE YOU MAY RECEIVE ORIGINAL FORMULA AND PACKAGING DURING THE TRANSITION Best-in-class nutrition and big-time taste? Merrick Classic Healthy Grains dry dog food treats your dog to both and more, in easily digestible recipes that balance protein, fruits, vegetables and a healthy blend of whole grains - including ancient grains to support optimal digestion - and supply high levels of fiber, Omega-3 and 6 fatty acids, glucosamine and chondroitin. Merrick Classic Healthy Grains is best for puppies and adult dogs. FULL OF FIBER AND WHOLE GRAINS. Crafted with a blend of grains including brown rice, barley and quinoa.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--classic-chicken+brown-rice-recipe-with-ancient-grains-dry-dog-food-4-lb/sw6n7n5.jpg'),
    (292, 'Merrick Classic Healthy Grains Small Breed Recipe Dry Dog Food, 12 lb', 12, 'food', 50, 'Best-in-class nutrition and big-time taste? Merrick Classic Healthy Grains dry dog food treats your dog to both and more, in easily digestible recipes that balance protein, fruits, vegetables and a healthy blend of whole grains - including ancient grains to support optimal digestion - and supply high levels of fiber, Omega-3 and 6 fatty acids, glucosamine and chondroitin. Merrick Classic Healthy Grains is best for puppies and adult dogs.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--classic-healthy-grains-small-breed-recipe-dry-dog-food-12-lb/7a4bfm4.jpg'),
    (293, 'Merrick Lil'' Plates Grain Free Beef And Sweet Potato Recipe With Raw Bites Dry Dog Food, 10 lb', 24, 'food', 56, 'Merrick Grain Free Lil'' Plates + Freeze Dried Raw Dry Dog Food recipes deliver a perfect combination of protein-rich, grain-free kibble plus real, whole pieces of freeze-dried raw meat for enhanced nutritional benefits and fresh taste of a raw diet in a convenient format for pet parents. Recipes are made in the USA.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--lil-plates-grain-free-beef-and-sweet-potato-recipe-with-raw-bites-dry-dog-food-10-lb/zd3uh3o.jpg'),
    (294, 'Merrick Backcountry Raw Infused Grain Free Puppy Recipe Dry Dog Food, 10 lb', 44, 'food', 56, 'Merrick Backcountry Raw Infused Grain-Free Puppy Recipe Dry Dog Food focuses on an all-natural grain-free ancestral canine diet packed with protein that dogs crave! This high protein recipe starts with real, freshly sourced deboned turkey which provides high amounts of omega fatty acids for healthy skin and coat as well as guaranteed levels of glucosamine and chondroitin to aid in hip and joint health. Merrick Backcountry Raw Infused Grain-Free Puppy Recipe Dry Dog Food has raw infused kibble accompanied by freeze dried raw protein pieces to add a nutrition and tasty protein boost that growing puppies need!', 'https://www.petproducts.com/static/upload/products/assorted/merrick--backcountry-raw-infused-grain-free-puppy-recipe-dry-dog-food-10-lb/rsw8joj.jpg'),
    (295, 'Merrick Backcountry Grain Free Hero''s Banquet Dry Dog Food, 20 lb', 11, 'food', 85, 'Hero''s Banquet recipes celebrate the work of our partner K9s For Warriors, whose mission is pairing specially trained rescue dogs with veterans suffering from post-traumatic stress disability (PTSD). Hero''s Banquet is available nationally year-round at Petco, independent pet supply stores and online. It starts with real deboned beef as the first ingredient for industry-leading 38 percent protein; includes proteins from pork, turkey, lamb and salmon; and a freeze-dried raw inclusion made from beef. Freeze-dried raw protein pieces are mixed into the kibble in a pure state to provide a nutritional boost, easy digestion and the fresh taste dogs love. The raw inclusion goes through rigorous testing and a proven process called High-Pressure Processing (HPP) to ensure food safety.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--backcountry-grain-free-heros-banquet-dry-dog-food-20-lb/6g2284t.jpg'),
    (296, 'Merrick Backcountry Grain Free Backcountry 96% Chicken Recipe Canned Dog Food, 12.7 oz, Case of 12', 23, 'food', 45, 'Merrick Backcountry Grain-Free Backcountry 96% Chicken Recipe Canned Dog Food focuses on quality protein and healthy fats that dogs thrive on. Starting with real and wholesome USDA-inspected deboned chicken, accompanied by the vitamins and minerals your dog needs for complete nutrition, it''s an excellent topper for dry kibble or a delicious stand-alone meal. Merrick Backcountry Grain-Free Backcountry 96% Chicken Recipe Canned Dog Food has no artificial colors, flavors, preservatives, or by-products.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--backcountry-grain-free-backcountry-96-chicken-recipe-canned-dog-food-127-oz-case-of-12/27zb36u.png'),
    (297, 'Merrick Backcountry Grain Free 96% Beef Recipe Canned Dog Food, 12.7 oz, Case of 12', 26, 'food', 45, 'Merrick Backcountry Grain-Free Backcountry 96% Beef Recipe Canned Dog Food focuses on quality protein and healthy fats that dogs thrive on. Starting with real and wholesome USDA-inspected deboned beef, accompanied by the vitamins and minerals your dog needs for complete nutrition, it''s an excellent topper for dry kibble or a delicious stand-alone meal. Merrick Backcountry Grain-Free Backcountry 96% Beef Recipe Canned Dog Food has no artificial colors, flavors, preservatives, or by-products.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--backcountry-grain-free-96-beef-recipe-canned-dog-food-127-oz-case-of-12/nyufa2s.png'),
    (298, 'Merrick Backcountry Grain Free Chunky Beef Canned Dog Food, 12.7 oz, Case of 12', 40, 'food', 45, 'Dish up the real meat your dog deserves with Merrick Backcountry Grain Free Wet Dog Food Chunky Beef Dinner in Gravy. Tender and chunky, this adult dog food starts with real deboned beef for a protein-rich formula that helps your dog build and maintain healthy muscle tissue and healthy energy levels. Natural ingredients go into every batch for wholesome goodness, along with vitamins and minerals for complete nutrition. Every chunky serving is grain- and gluten-free, so your dog gets a nutrient-rich beef dog food at mealtime. This hearty dog food gravy formula is crafted in our Hereford, TX kitchen and cooked in the USA.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--backcountry-grain-free-chunky-beef-canned-dog-food-127-oz-case-of-12/sfp6i8w.jpg'),
    (299, 'Merrick Lil'' Plates Small Breed Grain Free Real Chicken & Sweet Potato Dry Dog Food, 12 lb', 50, 'food', 50, 'Merrick Lil'' Plates Small Breed Grain-Free Real Chicken and Sweet Potato Dry Dog Food provides nutrition suited for your small breed pup with real foods sourced from local farmers. 55% of Merrick Lil'' Plates Small Breed Grain-Free Real Chicken and Sweet Potato Dry Dog Food is composed of meat and healthy fat ingredients that help build and maintain lean, healthy muscle tissue with high quality protein starting with deboned chicken. The remaining 45% is made up of fresh produce including easy to digest carbohydrates like potatoes and sweet potatoes which provide sustained energy without upsetting grain-sensitive systems. Also including omega fatty acids to promote healthy skin and coat as well as glucosamine to support joint health.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--lil-plates-small-breed-grain-free-real-chicken+sweet-potato-dry-dog-food-12-lb/rv7b666.png'),
    (300, 'Merrick Grain Free Real Chicken & Sweet Potato Dry Dog Food, 4 lb', 37, 'food', 24, 'The Merrick Grain Free dog food story is one of superior nutrition, delicious taste and using the highest quality ingredients. It''s about staying true to our roots and staying put in our original Hereford, Texas, USA kitchen - the one where Garth Merrick started our company and where we still hand craft our natural dog food recipes today. All Merrick Grain Free dry dog food recipes start with real deboned meat and real whole foods like sweet potatoes, blueberries, peas and more to provide natural dog food nutrition that''s complete and balanced - with leading levels of quality protein, plus Omega-6 and Omega-3 fatty acids to ensure great looking, healthy skin and coat. #1 INGREDIENT: DEBONED MEAT, FISH OR POULTRY: Merrick Grain Free dog food recipes contain leading levels of high quality proteins for healthy energy levels, building muscle mass and a great taste your dog will love.', 'https://www.petproducts.com/static/upload/products/assorted/merrick--grain-free-real-chicken+sweet-potato-dry-dog-food-4-lb/n2nf3un.jpg');
